INSERT INTO `blog` (`id`, `heading`, `photo`, `detail`, `writtenby`, `date`, `status`, `title`, `metatag`, `descp`) VALUES
(3, 'A Practical Guide to Finding Affordable Home Insurance', 'Home Insurance 2.jpg', '<p>\r\n	If my house were a ship, home insurance would be my anchor. It&#39;s a solid foundation for good nights of sleep and peace of mind. But figuring out which plan doesn&#39;t have you selling your first-born&#39;s left shoe to cover costs? Ah, now that&#39;s a skill worthy of a chat over a cup of coffee or two.</p>\r\n<h2>\r\n	<strong>Understanding the Basics of Home Insurance</strong></h2>\r\n<h3>\r\n	<strong>Definition and Importance of Home Insurance</strong></h3>\r\n<p>\r\n	Home insurance - this is your knight in shining armor when things go south with your lovely abode. It&#39;s a contract between you and an insurance company where the insurer pledges to pay for any damage or loss caused to your home or belongings for a certain premium. This gives us the warm &#39;n&#39; fuzzies because it&#39;s a backup plan that keeps our nest intact. Imagine a magic safety net catching everything precious in your life.</p>\r\n<h2>\r\n	<strong>Different Types of Home Insurance Policies</strong></h2>\r\n<p>\r\n	Now, let&#39;s add some flavor to this jargon pancake. There are several types of home insurance policies, just like there are several ice-cream choices (and who doesn&#39;t like ice cream?). To break it down, there are:</p>\r\n<ul>\r\n	<li>\r\n		<strong>HO-1:</strong>The Basic Form: the vanilla of home insurance, just the basics.</li>\r\n	<li>\r\n		<strong>HO-2:</strong>The Broad Form: it&#39;s vanilla with sprinkles, covering more than just the basics. Contents of your Home</li>\r\n	<li>\r\n		<strong>HO-3:</strong>The Special Form: oh, la la&mdash;we&#39;ve got the Sunday sundae here, it&#39;s the most comprehensive.</li>\r\n	<li>\r\n		<strong>HO-4:</strong>Tenant&#39;s Form: This is for all my renters out there&mdash;it&#39;s not the full sundae, but gets the job done just right!.</li>\r\n</ul>\r\n<h2>\r\n	<strong>3. The Role of Home Insurance in Financial Planning</strong></h2>\r\n<p>\r\n	Home insurance is not just a safety net, it&#39;s your guard dog in your financial planning backyard. It defends you from potentially devastating financial losses. A great home insurance policy is like a pair of great socks&mdash;they keep you warm, comfortable, and prevent cold feet when unexpected expenses come knocking!</p>\r\n<h2>\r\n	<strong>4. Assessing Home Insurance Needs</strong></h2>\r\n<ul>\r\n	<li>\r\n		<strong>Evaluating the Value of Your Home and Belongings</strong></li>\r\n</ul>\r\n<p>\r\n	So we&#39;ve talked about how home insurance is essentially our superhero, but how do we decide how much shield to buy for our precious fortress? First, get an accurate valuation of your home and belongings; think Clark Kent using his x-ray vision to size up the situation.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Identifying Potential Risks and Coverage Needs</strong></li>\r\n</ul>\r\n<p>\r\n	Next, put on the Sherlock Holmes hat&mdash;examine your home and its surroundings for potential risks. Is your house in an area prone to floods or earthquakes? Do you own precious valuables that require extra coverage? Could your dog, Rocket, potentially ruin your rare Persian carpet? Remember&mdash;never underestimate Rocket!.</p>\r\n<h2>\r\n	<strong>5. Navigating the Impact of Geographic Location on Insurance</strong></h2>\r\n<p>\r\n	Geography class was never this important! Your insurance needs can change significantly based on where home sweet home is. Live in an area plagued with earthquakes? You&#39;ll probably need to add that to your policy, trust me.</p>\r\n<h2>\r\n	<strong>6. Shopping for Affordable Home Insurance</strong></h2>\r\n<ul>\r\n	<li>\r\n		<strong>Comparing Insurance Quotes from Different Providers</strong></li>\r\n</ul>\r\n<p>\r\n	We check out Yelp reviews before going to a new restaurant, right? Consider this the Yelp for home insurance associations. Each insurance company will give you a different quote. Like Goldilocks, you need to choose a premium that is neither too high, nor, too low, but just right for your pocket, with complete coverages required.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Consulting Insurance Brokers and Agents</strong></li>\r\n</ul>\r\n<p>\r\n	Insurance agents and brokers are like your personal shoppers&mdash;they understand the market and can help you find the snuggliest fit for your needs. Brokers are independent and can give you quotes from multiple companies, while agents usually represent just one company. Choose wisely, my friend!</p>\r\n<ul>\r\n	<li>\r\n		<strong>Understanding the Impact of Deductibles on Premiums</strong></li>\r\n</ul>\r\n<p>\r\n	Now, an important part of this conversation is the &#39;deductible&#39;, what you pay out of your pocket when you make a claim. The general rule is higher deductible, lower premium, lower deductible, higher premium. It&#39;s like bowling the higher your score, the lower</p>\r\n', 'Shivansh Sharma', '2023-11-04', '', '', '', ''),
(5, 'Investing in mutual funds is like planting seeds of financial growth, where collective efforts bear the fruits of shared success.', 'Mutual fund_16.png', '<p style=\"margin: 0cm 0cm 0.0001pt;\">\r\n	<strong><span style=\"font-size: 13.5pt; font-family: Arial, &quot;sans-serif&quot;;\">What are Mutual Funds?</span></strong></p>\r\n<p>\r\n	<span style=\"white-space-collapse: preserve\"><span style=\"font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;;color:black\">Mutual funds are pools of funds collected by a bank or company to invest in a variety of stocks of companies. This is managed by fund managers who are very skilled in their job. Every bank or company has their respected fund manager.</span></span><span style=\"font-size: 9pt; font-family: Arial, &quot;sans-serif&quot;;\"><o:p></o:p></span></p>\r\n<p style=\"margin: 0cm 0cm 0.0001pt;\">\r\n	<strong><span style=\"font-size:15.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\ncolor:black\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; white-space-collapse: preserve;\">Benefits of investing through Mutual Funds</span></span></strong></p>\r\n<ul>\r\n	<li>\r\n		<span style=\"color: black; font-family: Arial, &quot;sans-serif&quot;; font-size: 10pt; text-indent: -18pt;\"><strong>Diversification:</strong> Mutual funds pool money from various investors to invest in a diversified portfolio of stocks, bonds, or other securities. This diversification helps spread risk, reducing the impact of poor performance from any single investment on the overall portfolio.</span></li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		<span style=\"color: black; font-family: Arial, &quot;sans-serif&quot;; font-size: 10pt; text-indent: -18pt;\"><strong>Professional Management:</strong> Mutual funds are managed by experienced fund managers who make investment decisions on behalf of the investors. These professionals conduct research, analyze market trends, and aim to optimize the fund&#39;s performance.</span></li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		<span style=\"font-size: 10pt; text-indent: -18pt; font-family: Arial, &quot;sans-serif&quot;; color: black;\"><strong>Accessibility:</strong> Mutual funds make investing accessible to a broad range of investors, even those with limited capital. With a relatively small investment, investors can gain exposure to a diversified portfolio that would otherwise require a significant amount of capital to assemble individually.</span></li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		<span style=\"color: black; font-family: Arial, &quot;sans-serif&quot;; font-size: 10pt; text-indent: -18pt;\"><strong>Liquidity: </strong>Mutual funds are generally liquid investments, allowing investors to buy or sell units on any business day at the net asset value (NAV). This liquidity provides flexibility for investors who may need to access their money relatively quickly.</span></li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		<span style=\"font-size: 10pt; text-indent: -18pt; font-family: Arial, &quot;sans-serif&quot;; color: black;\"><strong>Affordability:</strong> Mutual funds enable investors to participate in the financial markets with a relatively low initial investment. Investors can also contribute regularly through systematic investment plans (SIPs), making it easier to build a portfolio over time.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size: 10pt; text-indent: -18pt; font-family: Arial, &quot;sans-serif&quot;; color: black;\"><strong>Regulatory Oversight:</strong> Mutual funds are regulated by financial authorities, providing a level of transparency and accountability. Regulatory oversight helps ensure that fund managers operate within specified guidelines, protecting the interests of investors.</span></li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		<span style=\"font-size: 10pt; text-indent: -18pt; font-family: Arial, &quot;sans-serif&quot;; color: black;\"><strong>Flexibility:</strong> Mutual funds offer a variety of investment options to suit different risk appetites and investment goals. There are equity funds, bond funds, hybrid funds, index funds, and sector-specific funds, allowing investors to choose based on their preferences and financial objectives.</span></li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		<span style=\"color: black; font-family: Arial, &quot;sans-serif&quot;; font-size: 10pt; text-indent: -18pt;\"><strong>Convenience:</strong> Investing in mutual funds is relatively simple. Investors can buy and sell units through fund houses, online platforms, or financial advisors. Fund houses also provide regular updates and statements, making it easy for investors to track their investments.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"color: black; font-family: Arial, &quot;sans-serif&quot;; font-size: 10pt; text-indent: -18pt;\"><strong>Automatic Reinvestment:</strong> Many mutual funds offer the option for automatic reinvestment of dividends and capital gains, allowing for the compounding of returns over time.</span></li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n		<span style=\"color: black; font-family: Arial, &quot;sans-serif&quot;; font-size: 10pt; text-indent: -18pt;\"><strong>Tax Benefits:</strong> In some jurisdictions, certain types of mutual funds offer tax advantages. For example, some funds may provide tax-free dividends or capital gains, contributing to potential tax efficiency.</span></li>\r\n</ul>\r\n', 'SOHAN BHATTACHRAJEE ', '2024-01-11', '', '', '', ''),
(6, 'Highlight convenience and ease \"Swipe smarter, simplify finance\"', 'credit-card-types.jpg', '<p style=\"margin-left:36.0pt;\">\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>What is a Credit Card?</strong></p>\r\n<p style=\"margin-left:36.0pt;\">\r\n	Credit card is a card that lets you borrow money to pay for things now, with the promise to pay it back later. Think of it like a temporary loan you carry in your pocket!</p>\r\n<p>\r\n	<strong>What are potential benefits of credit cards?</strong></p>\r\n<p>\r\n	There are various benefits of credit card few of them are:</p>\r\n<ul>\r\n	<li>\r\n		<strong>Building credit history:</strong>Making on-time payments for your credit card builds a positive credit history, which can be crucial for securing loans, mortgages, and other forms of credit in the future with potentially lower interest rates.</li>\r\n	<li>\r\n		<strong>Convenience and security:</strong>Credit cards offer contactless payment options and purchase protection features, eliminating the need to carry large amounts of cash and providing protection against fraudulent transactions.</li>\r\n	<li>\r\n		<strong>Rewards and benefits:</strong>Many credit cards offer rewards programs, cashback, travel miles, or other perks that can help you save money or enhance your lifestyle.</li>\r\n	<li>\r\n		<strong>Budgeting and tracking:</strong>Credit card statements provide detailed records of your spending, which can help you track your expenses and manage your budget more effectively.</li>\r\n</ul>\r\n<p>\r\n	Credit Cards can be a great tool but you need to look after a few important points so that you can enjoy the benefits.&nbsp;</p>\r\n<p>\r\n	<strong>Important things to remember:</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Only use credit cards if you can afford to pay off the balance in full each month.</strong>Carrying a balance accrues interest charges, which can quickly escalate and lead to debt.</li>\r\n	<li>\r\n		<strong>Choose a credit card with features and rewards that align with your spending habits and financial goals.</strong>Don&#39;t be swayed by high introductory offers if you can&#39;t realistically meet the requirements.</li>\r\n	<li>\r\n		<strong>Pay close attention to interest rates, annual fees, and other charges associated with your credit card.</strong>Different cards have different terms, so compare options carefully before choosing one.</li>\r\n	<li>\r\n		<strong>Monitor your credit card activity regularly and promptly report any suspicious activity.</strong></li>\r\n</ul>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara?</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<ul>\r\n	<li>\r\n		<strong>We start by asking questions:</strong>What are your spending habits? Are you looking for rewards, cashback, or travel points? Do you carry a balance often? Do you value travel insurance or extended warranties?</li>\r\n	<li>\r\n		<strong>Analyze your income and expenses:</strong>We try to understand your financial health and help assess if a credit card fits your budget and what features are most beneficial to you.</li>\r\n</ul>\r\n<p>\r\n	<strong>2. We help you to explore different credit card options:</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>We share our findings:</strong>Based on your answers, We can research various credit cards and present potential options that cater to your specific needs.</li>\r\n	<li>\r\n		<strong>We compare features and fees:</strong>We can analyze interest rates, annual fees, rewards programs, and other charges to find a card that offers the best value for your situation. There are various cards with zero annual fees.</li>\r\n</ul>\r\n<p>\r\n	<strong>3. Assess the risks and benefits:</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>We guide responsible credit card use:</strong>We can help you understand the importance of paying your balance in full and avoiding unnecessary debt.</li>\r\n	<li>\r\n		<strong>Evaluate potential benefits:</strong>We can discuss how the card&#39;s rewards or features can save you money, build your credit score, or enhance your lifestyle.</li>\r\n</ul>\r\n<p>\r\n	<strong>4. Guide you towards informed decision-making:</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>We provide unbiased information:</strong>We can explain different card terms and conditions without promoting any specific products.</li>\r\n</ul>\r\n<p>\r\n	<strong>We encourage further research:</strong>We can explore relevant resources and reviews to gather additional information before making a final decision.</p>\r\n', 'Shivansh Sharma', '2024-02-15', '', 'Highlight convenience and ease \"Swipe smarter, simplify finance\"', 'Highlight convenience and ease \"Swipe smarter, simplify finance\"', 'Highlight convenience and ease \"Swipe smarter, simplify finance\"'),
(8, 'Covered in Wellness Your Path to Protection and Peace of Mind', 'health insurance.jpeg', '<p>\r\n	<span id=\"docs-internal-guid-986318ed-7fff-42b7-a2f9-661aad640a4d\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(51, 56, 70); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Health insurance is an agreement between the insurer and the policyholder whereby an insurance company agrees to reimburse for medical costs incurred by the policyholder during the tenure of the policy. According to the policy terms, the insured may incur medical expenses if they get ill or meet an unfortunate accident that leads to treatment at the hospital. To avail of the coverage benefits of a health insurance policy, the policyholder must pay a specific amount periodically, called a premium. The premium is determined by the insurance company and must be paid by the policyholders without any fail either monthly, quarterly, half-yearly or annually.</span></span><br />\r\n	&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height:1.9636363636363636;text-align: justify;margin-top:0pt;margin-bottom:0pt;\">\r\n	<span style=\"font-size:24px;\"><span><span style=\"font-family: Arial, sans-serif; color: rgb(51, 56, 70); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Why Should You Buy Health Insurance?</span></span></span><br />\r\n	<span style=\"background-color: transparent; color: rgb(51, 56, 70); font-family: Arial, sans-serif; font-size: 10.5pt; white-space: pre-wrap;\">In today&rsquo;s uncertain times and with changing lifestyles, you may never know when a medical emergency will knock on your door. To stay protected against such unpredictabilities, it is very important to stay secure with health insurance. There are several other reasons why you should buy this beneficial health plan, some of which are listed below</span><br />\r\n	<br />\r\n	<span style=\"background-color: transparent; font-size: 13.5pt; white-space: pre-wrap; color: rgb(51, 56, 70); font-family: Arial, sans-serif;\"><span style=\"font-size:20px;\"><strong>Rising Medical Expenses</strong></span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:2.057142857142857;margin-top:0pt;margin-bottom:0pt;\">\r\n	<span id=\"docs-internal-guid-1b035c46-7fff-3f0b-f3a7-14b018b703db\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(51, 56, 70); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Over the years, the cost of healthcare in India has witnessed a sharp rise so much so that it becomes difficult to access quality medical assistance. It is the increase in the cost of medicines, hospitalisation, medical examinations, and more that have together led to an overall increase in medical expenses. With this rise in medical expenses, it makes all the more sense to buy a health insurance plan that helps you stay protected against such medical emergencies. Depending on your healthcare needs, buy a suitable plan for yourself and your loved ones.<br />\r\n	<span style=\"background-color: transparent; font-size: 13.5pt;\"><span style=\"font-size:20px;\"><strong>Altering Lifestyle</strong></span></span></span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:2.057142857142857;margin-top:0pt;margin-bottom:0pt;\">\r\n	<span id=\"docs-internal-guid-5b62e06d-7fff-b6f9-0ae5-f52a71b69995\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(51, 56, 70); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The current-day modern lifestyle is such that individuals have been exposed to health problems even more. The 9-5 job, eating habits, disrupted sleep cycle, and more have together contributed to an unhealthy lifestyle. Due to the unhealthy lifestyle, a number of health problems such as obesity, asthma, have constantly been rising. Moreover, apart from physical problems, the unhealthy lifestyle has also led to increased mental health problems. Thus, due to all of these reasons, it becomes all the more important to buy a medical insurance policy in India.<br />\r\n	<span style=\"font-size:20px;\"><strong>Tax Benefits </strong></span></span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:2.057142857142857;margin-top:0pt;margin-bottom:0pt;\">\r\n	<span id=\"docs-internal-guid-aadd2f36-7fff-7162-37cd-f81d7f70a229\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 56, 70); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-size: 10.5pt;\">A plan like health insurance not only protects you from medical emergencies but also provides tax benefits. It is the premium that is paid towards such plans that offer tax benefits under the Income Tax Act of 1961. The tax benefits vary from one group to another, for instance, the tax benefits for senior citizens are higher as compared to the others. Policyholders can avail of maximum benefit of Rs. 75,000 against their policy.</span><br />\r\n	<span style=\"background-color: transparent;\"><strong style=\"font-size: 20px;\">Network Hospitals</strong></span></span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:2.057142857142857;margin-top:0pt;margin-bottom:14pt;\">\r\n	<span id=\"docs-internal-guid-695d99e7-7fff-4c83-328c-8eca0448938c\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(51, 56, 70); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Network hospitals or cashless hospitals are those where policyholders can avail of cashless treatment. The number of network hospitals varies from one health insurance company to another. Thus, it is important that you check the availability of network hospitals while buying the plans. With the availability of network hospitals, it becomes easier to avail of quick and cashless claims.</span></span><br />\r\n	<span style=\"background-color: transparent; font-size: 13.5pt; white-space: pre-wrap; color: rgb(51, 56, 70); font-family: Arial, sans-serif;\"><span style=\"font-size:20px;\"><strong>Pre-existing Disease Coverage</strong></span></span><br />\r\n	<span style=\"background-color: transparent; color: rgb(51, 56, 70); font-family: Arial, sans-serif; font-size: 10.5pt; white-space: pre-wrap;\">Health insurance plans also offer coverage for pre-existing diseases after a specific waiting period. However, if you want to get health insurance coverage for these pre-existing conditions like diabetes, hypertension, and more, you can also buy a plan that offers coverage for pre-existing diseases from the start. You can also check with your insurer regarding the coverage for pre-existing diseases in your mediclaim plan.</span><br />\r\n	<span style=\"background-color: transparent; font-size: 13.5pt; white-space: pre-wrap; color: rgb(51, 56, 70); font-family: Arial, sans-serif;\"><span style=\"font-size:20px;\"><strong>Pre and Post Hospitalisation Expenses</strong></span></span><br />\r\n	<span style=\"background-color: transparent; color: rgb(51, 56, 70); font-family: Arial, sans-serif; font-size: 10.5pt; white-space: pre-wrap;\">With a number of health insurance policies available in India, you will also get coverage for pre and post-hospitalisation expenses. Once you are insured with a relevant type of plan, you can enjoy financial coverage for both pre and post hospitalisation.</span></p>\r\n', 'shivansh sharma', '2024-05-01', '', 'Health Insurance ', 'Health Insurance ', '');
INSERT INTO `career` (`id`, `jobtitle`, `salary`, `detail`, `status`, `added_on`, `qualification`, `exp`, `location`, `mode`, `photo`) VALUES
(2, 'Relationship Officer (Calling)', 'Upto 2.5 Lacs Per Year', '<div style=\"text-align: justify;\">\r\n	<p>\r\n		This is a full-time role for a <strong>Relationship Officer (Calling)</strong> located in Delhi - Rajouri Garden/ Laxmi Nagar. The role involves day-to-day tasks like lead generation, outbound sales, and telemarketing for multiple products like Credit Card, Loans, Insurance, and Investment Products. The candidate may work remotely after a few weeks of product training.</p>\r\n	<p>\r\n		<strong>Qualification:</strong></p>\r\n	<p>\r\n		Graduate (minimum) for freshers with up to 2 year of experience</p>\r\n	<p>\r\n		<strong>Job Profile</strong></p>\r\n	<p>\r\n		Excellent communication and sales skills</p>\r\n	<p>\r\n		Experience in outbound sales for Credit cards, Loans, and Insurance products&nbsp;like Motor, Health, etc.</p>\r\n	<p>\r\n		Ability to generate leads and convert them into sales</p>\r\n	<p>\r\n		Experience in creating and maintaining relationships with customers</p>\r\n	<p>\r\n		<strong>Location</strong></p>\r\n	<p>\r\n		Options of both onsite or work-from-home are available post-complete training and Sales performance.</p>\r\n</div>\r\n', 'Active', '2024-01-05', 'Undergraduates & Graduates ', '0-2 yrs', 'Delhi, Rajouri Garden, Laxmi Nagar', 'WFH', ''),
(3, 'Human Resource ', 'Upto 3 Lacs Per Year', '<p>\r\n	Human Resources Development Manager plays a pivotal role in ensuring the effective management of human capital within the Company. This position oversees various HR functions aimed at attracting, developing, and retaining top talent while fostering a positive work culture conducive to the company&#39;s success.</p>\r\n<p>\r\n	<strong>Job Profile:</strong></p>\r\n<ul>\r\n	<li>\r\n		Recruitment and Talent Acquisition.</li>\r\n	<li>\r\n		Develop and implement recruitment strategies to attract skilled professionals within the finance and advisory industry.</li>\r\n	<li>\r\n		Conduct interviews, access candidates, and collaborate with various agencies to fill open positions efficiently.</li>\r\n	<li>\r\n		Manage onboarding processes to ensure a smooth transition for new recruitments.</li>\r\n	<li>\r\n		Ensure and maintain the Training schedule for all employees.</li>\r\n</ul>\r\n<p>\r\n	<strong>Employee Relations:</strong></p>\r\n<ul>\r\n	<li>\r\n		Act as a point of contact for employee inquiries, concerns, and grievances, ensuring fair and consistent resolution.</li>\r\n	<li>\r\n		Foster a positive work environment by promoting open communication and conflict resolution strategies.</li>\r\n	<li>\r\n		Develop and implement employee engagement initiatives to enhance morale and productivity.</li>\r\n	<li>\r\n		Performance Management:</li>\r\n	<li>\r\n		Administer performance appraisal processes and guide managers on performance evaluation and goal-setting.</li>\r\n	<li>\r\n		Identify training needs and coordinate professional development programs to enhance employee skills and competencies.</li>\r\n</ul>\r\n', 'Active', '2024-01-05', 'Min Graduate , MBA fresher or  HR Interns', '0-2 years', 'Faridabad & Vikash Marg Delhi', 'WFO', ''),
(4, 'Area Head - Sales & Marketing', 'Upto 8 Lacs Per Year', '<p>\r\n	The Area Manager is responsible for actively promoting and selling financial products, Like Home loan, personal Loan &amp; Business loan or Credit cards. This role involves engaging with potential customers, explaining product features, and persuading them to purchase financial solutions offered by the company.</p>\r\n<div>\r\n	<strong>Job Profile</strong></div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<b>Key Areas required</b></div>\r\n<ul>\r\n	<li>\r\n		<div>\r\n			Prior exp. of Banks or NBFCs or DSAs upto 5 years or more.</div>\r\n	</li>\r\n	<li>\r\n		<div>\r\n			Responsible for key tie ups with the Banks &amp; NBFCs</div>\r\n	</li>\r\n	<li>\r\n		<div>\r\n			Build and maintain relationships with customers to understand their financial needs and preferences.</div>\r\n	</li>\r\n	<li>\r\n		Follow up with leads and inquiries, addressing customer questions and concerns regarding financial products.</li>\r\n	<li>\r\n		<div>\r\n			Acquire a comprehensive knowledge of the company&#39;s financial products, including loans, insurance policies, and investment options, to effectively communicate their features and advantages.</div>\r\n	</li>\r\n	<li>\r\n		<div>\r\n			Assist customers in completing necessary paperwork and documentation related to their chosen financial products.</div>\r\n	</li>\r\n	<li>\r\n		<div>\r\n			Meet or exceed sales targets by actively pursuing sales opportunities and consistently closing deals.</div>\r\n	</li>\r\n	<li>\r\n		<div>\r\n			Maintain accurate records of sales activities, customer interactions, and sales outcomes for reporting purposes.</div>\r\n	</li>\r\n</ul>\r\n', 'Active', '2024-01-05', 'Graduation or MBA ', '4-5 years', 'Faridabad / Vikash Marg Delhi', 'WFO', ''),
(5, 'RM Sales & Marketing ', 'Upto 3 Lacs Per Year', '', 'Active', '2024-03-22', 'Graduates , Interns  , BBA, MBA Fresher.', 'Minimum 1 Year', 'Vikash Marg, Faridabad and Delhi NCR Region ', 'HYBRID', ''),
(6, ' Executive - Finance and Accounts', 'Upto 3 Lacs Per Year', '', 'Active', '2024-03-22', 'B.Com , CA Interns', 'Minimum 2 Years in the GST ,Taxation and Accounts', 'Faridabad', 'HYBRID', ''),
(7, 'Lending Counsellor - Marketing', 'Upto 2.5 Lacs Per Year', '<p style=\"text-align: justify;\">\r\n	This is a full-time role for a <b>Lending Counsellor ( Marketing )&nbsp;</b>&nbsp;located in Delhi - Rajouri Garden/ Laxmi Nagar, Vikash Marg and Faridabad. The role involves day-to-day tasks like lead generation, outbound sales, and telemarketing for multiple products like Credit Card, Loans, Insurance, and Investment Products. The candidate may work remotely after a few weeks of product training.</p>\r\n', 'Active', '2024-03-22', 'Undergraduates & Graduates', 'Fresher , Experience Upto 1 year ', 'Faridabad & Delhi - Laxmi Nagar , Vikash Marg and Rajori Garden ', 'WFO', ''),
(8, 'Manager & Senior Manager - Banking Relations ', 'Upto 8 Lacs Per Year', '', 'Active', '2024-03-22', 'Graduate , BBA , MBA & Post Graduate ', 'Minimum 3 to 4 years experience in lending products - Home loans/ Personal Loan/Business Loans/ Card', 'Faridabad / Vikash Marg Delhi', 'WFO', ''),
