(302, 'Krishan Kumar', 'krishankkumar0609@gmail.com', '8660485384', 'Manager & Senior Manager - Banking Relations -Dear Hiring Manager,\r\nI am submitting my candidaturefor the Manager & Senior Manager - Banking Relations position at Insofy company. With an MBA in finance and over two years of experience in finance and operations, I have a proven track record in driving strategic initiatives and improving processes. I am confident that my skills and experience will allow me to make a valuable contribution to your esteemed organization.\r\nAt present, I am serving as a Financial Analyst at Citi Bank, where my responsibilities mainly include managing annual, semi-annual, and quarterly financial reports, customizing shareholder reports, financial statements, and investment portfolios. Here, I leveraged data management tools like Confluence, Excel, and SQL for data scrapping and analysis, which culminated in reducing analytical time from 2-3 hours to a mere 15 minutes. Parallely, I automated and streamlined over a quarter of foreign investment processes. Additionally, I have a commendable record of maintaining financial accuracy, and my efforts have helped in increasing the accuracy rate to an impressive 90%.\r\nPreviously, I held the post of Production Executive at V2, where I strategized production processes and effectively collaborated with production and sampling teams. I honed my analytical skills bydeeplyscrutinizing production data for precise forecasting, thereby significantly reducing loss and improving efficiency. Moreover, I developed a comprehensive report format, collaborating with the business team to automate the process of MRDC reports for the planning and analysis of production, sales, and stocks, and I compiled them into a single ERP system using Power BI and Oracle. Also, I generated meaningful insights for leadership through sales report dashboards using Power BI.\r\nIn addition to the above, during my tenure as a Finance Intern at Lernovate E-commer