(1156, 'Souren Pal', 'souren.pal128@nmims.edu.in', '7011505103', 'Human Resource -My educational background, including an MBA in Human Resources from SBM NMIMS Mumbai, has equipped me with comprehensive knowledge of talent management, performance management, and organizational development. Furthermore, my hands-on experience as a Summer Intern at Packfora and various HR internships have honed my end-to-end recruitment, stakeholder management, and strategic thinking skills.\r\n\r\nAt Packfora, I spearheaded the development of a robust campus engagement strategy spanning multiple regions, which enhanced recruitment efficiency and amplified brand presence among college students. Additionally, I led initiatives to fortify employer branding through comprehensive social media strategies and revamped onboarding processes to ensure a seamless experience for new hires.\r\n\r\nDuring my internship at IMS Learning, I significantly increased the talent pipeline by 30% through proactive sourcing and screening efforts. I collaborated closely with hiring managers to align recruitment strategies with business objectives, resulting in a 25% reduction in time-to-fill. Furthermore, I contributed to employer branding initiatives that led to a 30% increase in applicant engagement.\r\n\r\nMy recent internship at Motilal Oswal Financial Services provided me with the opportunity to develop and benchmark innovative programs for Management Trainees and collaborate with sales professionals to enhance learning and development initiatives. These experiences have further strengthened my strategic mindset and ability to drive impactful recruitment outcomes.\r\n\r\nI am confident that my proactive approach and passion for fostering talent and driving organizational success make me a strong fit for this role.\r\n', '2024-07-09 00:00:21', '', '0000-00-00', '', 0, '0000-00-00', '08-07-24-cv-Souren_Pal_CV__.pdf', 'Career', 'Career Page-Human Resource '),
