INSERT INTO `content` (`id`, `category`, `heading`, `photo`, `detail`, `status`, `title`, `metatag`, `descp`) VALUES
(1, 'Home', 'Dream Big! Achieve Bigger: Empowering Financial Futures, Enriching Lives', 'Laptop.jpg', '<p>\n	We believe in the power of ambition and the potential of every individual and bussiness to dream big.The emphasize is not only on the aspiration to dream big but also the commitment to help individuals, particulary women, and business, achieve their most significant financial goals and dreams. We are dedicated to bridging the rural-urban divide by providing inclusive financial solutions to remote &amp; unserserved areas.</p>', '', 'INSOFY', 'insofy|Finance', 'Dream Big! Achieve Bigger: Empowering Financial Futures, Enriching Lives'),
(2, 'About Us', 'Our Vision and Mission ', 'iStock_000039291924_Medium.jpg', '<p>\n	We believe in the power of ambition and the potential of every individual and bussiness to dream big.The emphasize is not only on the aspiration to dream big but also the commitment to help individuals, particulary women, and business, achieve their most significant financial goals and dreams. We are dedicated to bridging the rural-urban divide by providing inclusive financial solutions to remote &amp; unserserved areas. We believe in creating a world where every individual, regardless of their background or location, has access to financial empowerment and a brighter, more secure future.</p>\n<h4>\n<!--4--></h4>\n', '', '', '', ''),
(3, 'Why', 'Expertise and Experience', '', '<p>\r\n	Our team consists of seasoned financial professionals with extensive industry knowledge and experience. We leverage this expertise to provide valuable insights and customized solutions for our clients.</p>\r\n', '', '', '', ''),
(4, 'Why', 'Innovative Technology', '', '<p style=\"text-align: justify;\">\r\n	We harness the power of advanced financial technology to offer cutting edge solutions that are efficient, secure, and user-friendly. add one line more in it</p>\r\n', '', '', '', ''),
(5, 'Why', 'Commitment to Excellence', '', '<p>\r\n	We are dedicated to delivering exceptional service and exceeding our clients&#39; expectations. Our commitment to excellence is evident in every interaction and solution we provide.</p>\r\n', '', '', '', ''),
(6, 'Why', 'Trust and Security', '', '<p>\r\n	We prioritize the confidentiality and security of our clients&#39; financial information. We employ Robust Security measures and adhere to strict compliance standards to ensure the protection of sensitive data.</p>\r\n', '', '', '', ''),
(7, 'Why', 'Target Market', '', '<p>\r\n	We caters to a diverse range of customers, including individuals, small and medium-sized businesses, corporations, and institutional investors. We serve clients across various industries, such as finance, technology, Education, healthcare, manufacturing, retail, and more.</p>\r\n', '', '', '', ''),
(8, 'Mission', 'Mission', 'insurance-adeedswara.png', '<p style=\"text-align: justify;\">\r\n	Our mission is to simplify the insurance process and empower our clients by offering personalized, transparent, and cost-effective insurance solutions. We strive to build long-term relationships with our clients, providing them with peace of mind and financial protection through expert advice, exceptional service, and access to a wide range of insurance options.</p>\r\n<h3>\r\n	&nbsp;</h3>\r\n<h4>\r\n	<strong>&ldquo;OUR GOAL IS TO BE THE TRUSTED FINANCIAL PARTNER OF CHOICE, GUIDING CLIENTS TOWARDS FINANCIAL INCOME &amp; WELLBEING&rdquo;</strong></h4>\r\n', '', '', '', ''),
(9, 'Vision', 'Team', 'Loan-adeedswara.png', '<p style=\"text-align: justify;\">\r\n	At Aadeeshwara Fintech Pvt. Ltd.,we take great pride in the fact that our team members are not just professionals; they are dedicated and passionate individuals who are committed to your financial success.&nbsp;&nbsp;<strong>Our financial experts come from various backgrounds, with extensive experience in the fields of loans, insurance and investments</strong>. We undestand that every client has distinct aspirations, goals and dreams and keeping this is mind we provide tailored solutions that cater to specific needs of customers.</p>', '', '', '', ''),
(10, 'Partner', 'Join Us as a Partner  Lets Embrace Success Together', 'become a partner.jpeg', '<p>\r\n	As an aspiring company, Aadeeshwara Fintech Private Limited, represents the vigour &amp; potential of an organization ready to ascend new heights. Our mission is to grow together with our partners, leveraging our fresh perspectives, innovative strategies, and forward-thinking approach.</p>\r\n<p>\r\n	If You are a:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<ul>\r\n	<li>\r\n		Self-Employed Person</li>\r\n	<li>\r\n		Retired Person</li>\r\n	<li>\r\n		Homemaker</li>\r\n	<li>\r\n		Small &amp; Medium Entrepreneur</li>\r\n	<li>\r\n		Community Head &ndash; Towns or Villages</li>\r\n	<li>\r\n		Part-Time/ Full-Time Professional</li>\r\n	<li>\r\n		Young Graduate exploring Business ideas&nbsp; &nbsp;&nbsp;</li>\r\n</ul>\r\n<p>\r\n	We invite you to join us on this promising journey. We have a twofold mission to empower individuals and to uplift communities with the inclusion of women&rsquo;s financial well-being &amp; penetration of financial services in rural parts of our country.&nbsp; Our new plans and infrastructure for partners reflect our commitment to creating a rewarding path for all.</p>\r\n<p>\r\n	Our financial experts come from various backgrounds, with extensive experience in the fields of loans, insurance, and investments. We take great pride in the fact that our team members are not just professionals; they are dedicated and passionate individuals who are committed to your financial success.</p>\r\n<p>\r\n	At Aadeeshwara Fintech Pvt. Ltd., we are more than just a financial service provider.&nbsp; We&rsquo;re a team of experts who are passionate about shaping the future of finance.</p>\r\n<p>\r\n	Here&#39;s why you should consider partnering with us:</p>\r\n<ul>\r\n	<li>\r\n		Unlimited Earning</li>\r\n	<li>\r\n		Zero Investment</li>\r\n	<li>\r\n		Multiple Products under One Umbrella</li>\r\n	<li>\r\n		Best in class Service support &ndash; Apka customer, jimmedaari Hamari</li>\r\n	<li>\r\n		Expert advice and innovative solutions</li>\r\n	<li>\r\n		No Geographical restriction</li>\r\n	<li>\r\n		Best Income &amp; Rewards in this segment</li>\r\n	<li>\r\n		Long Term association attached with unlimited benefits.</li>\r\n	<li>\r\n		Technology-enabled support - Your mobile is your system</li>\r\n	<li>\r\n		Realtime Business Dashboard</li>\r\n	<li>\r\n		Minimum Documentation</li>\r\n	<li>\r\n		One-click Registration process</li>\r\n	<li>\r\n		Robotic Automation and AI-driven processes</li>\r\n</ul>\r\n<p>\r\n	What sets us apart is our commitment to providing customized financial solutions. We have tie-ups with major Banks, NBFCs, and top Insurance companies. Our team works closely with you to create a financial plan that aligns with your customer&rsquo;s goals &amp; dreams. To ensure seamless &amp; convenient access to our products, we leverage on cutting-edge technology.&nbsp; Our online platforms and tools make managing your finances easier, so you can focus on what truly matters.</p>\r\n', '', '', '', ''),
(11, 'privacy Policy', 'Privacy Policy', '', '<p style=\"text-align: justify;\">\r\n	Welcome to <a href=\"http://www.insofy.in/\" target=\"_new\">www.insofy.in</a>, a website owned and operated by Aadeeshwara Fintech Pvt. Ltd (&quot;we,&quot; &quot;us,&quot; or &quot;our&quot;). This Privacy Policy is designed to help you understand how we collect, use, disclose, and safeguard your personal information in compliance with the Information Technology Act, 2000 of India.</p>\r\n<p style=\"text-align: justify;\">\r\n	<strong>Information We Collect:</strong></p>\r\n<p style=\"text-align: justify;\">\r\n	When you visit our website, we may collect personal information such as your name, contact details, Email Id, Photo, PAN no., Aadhar, and other identification information. In the process of Partner KYC (Know Your Customer), we may collect additional details required for verification purposes.</p>\r\n<p style=\"text-align: justify;\">\r\n	We may collect data related to your communication with us, including E-mails, WhatsApp messages, and Facebook Messenger interactions.</p>\r\n<p style=\"text-align: justify;\">\r\n	If you choose to apply for a job with us, we may collect information such as your resume, cover letter, and other relevant details.</p>\r\n<p style=\"text-align: justify;\">\r\n	<strong>How We Use Your Information:</strong></p>\r\n<p style=\"text-align: justify;\">\r\n	In general, we will use the information collected from you for the purpose for which you provided such information. We will not release your Personally Identifiable Consumer Information to third parties except:</p>\r\n<p style=\"text-align: justify;\">\r\n	(1) as necessary for us to process your transaction, or</p>\r\n<p style=\"text-align: justify;\">\r\n	(2) as permitted by law, or</p>\r\n<p style=\"text-align: justify;\">\r\n	(3) to Aadeeshwara group companies for marketing and advertisement purposes.</p>\r\n<p style=\"text-align: justify;\">\r\n	We use communication data to respond to your inquiries, provide information about our products and services, and maintain customer support. We may use the information we collect for various purposes, including but not limited to:</p>\r\n<ul>\r\n	<li style=\"text-align: justify;\">\r\n		Providing, maintaining, and improving the Service.</li>\r\n	<li style=\"text-align: justify;\">\r\n		Sending administrative and service-related communications.</li>\r\n	<li style=\"text-align: justify;\">\r\n		Responding to your requests or inquiries.</li>\r\n	<li style=\"text-align: justify;\">\r\n		Personalizing your experience on the Service.</li>\r\n	<li style=\"text-align: justify;\">\r\n		Conducting research and analysis to better understand our users.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">\r\n	When you apply for employment, we use your personal information for recruitment purposes only.</p>\r\n<p style=\"text-align: justify;\">\r\n	When you provide information on our website, you need to ensure that the information is accurate. If you believe that there is an error, you are advised to review the same before submission. For protection of your information, we use security technologies to safeguard any information that you provide.</p>\r\n<p style=\"text-align: justify;\">\r\n	Our website uses cookies to enhance your user experience. You can manage your cookie preferences through yourbrowser settings.</p>\r\n<p style=\"text-align: justify;\">\r\n	<strong>Sharing of Information</strong></p>\r\n<p style=\"text-align: justify;\">\r\n	We may share your personal information in the following situations:</p>\r\n<ul>\r\n	<li style=\"text-align: justify;\">\r\n		With service providers and contractors who help us operate and improve the Service.</li>\r\n	<li style=\"text-align: justify;\">\r\n		When required by law, such as to comply with a subpoena or similar legal process.</li>\r\n	<li style=\"text-align: justify;\">\r\n		To protect our rights, privacy, safety, or property, or that of our users or others.</li>\r\n	<li style=\"text-align: justify;\">\r\n		You may have the right to access, correct, or delete your personal information. You can do so by logging into your account or contacting us.</li>\r\n	<li style=\"text-align: justify;\">\r\n		To facilitate partner verification processes.</li>\r\n	<li style=\"text-align: justify;\">\r\n		To communicate with you through third-party messaging platforms.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">\r\n	You can opt out of receiving promotional communications from us by following the instructions in those communications.</p>\r\n<p style=\"text-align: justify;\">\r\n	<strong>Security Measures</strong></p>\r\n<p style=\"text-align: justify;\">\r\n	We take reasonable measures and employ industry-standard security measures to protect your personal information from unauthorized access, disclosure, alteration, and destruction</p>\r\n<p style=\"text-align: justify;\">\r\n	Company has taken appropriate steps for the security &amp; protection of the Website. However, the Company will not be held responsible for any breach of security or the disclosure of personal data due to reasons beyond its control. Such reasons may include hacking, social engineering, cyber terrorism, espionage by third parties, or any events that fall under force majeure, such as sabotage, fire, flood, explosion, acts of God, civil commotion, strikes, or industrial action of any kind, riots, insurrection, war or acts of government.</p>\r\n<p style=\"text-align: justify;\">\r\n	<strong>Changes to this Privacy Policy</strong></p>\r\n<p style=\"text-align: justify;\">\r\n	We may update this Privacy Policy to reflect changes to our information practices. We will post any changes on this page and encourage you to review this page periodically for the latest information on our privacy practices.</p>\r\n<p style=\"text-align: justify;\">\r\n	<strong>Contact Us</strong></p>\r\n<p style=\"text-align: justify;\">\r\n	If you have any questionsabout this Privacy Policy, please contact us at <a href=\"mailto:enquiry@insofy.in\">enquiry@insofy.in</a></p>\r\n<p style=\"text-align: justify;\">\r\n	By using our website, you consent to the terms of this Privacy Policy.</p>\r\n', '', '', '', ''),
(12, 'Why', 'Holistic Financial Solutions', '', '<p>\r\n	We go beyond traditional services by offering comprehensive financial solutions that address the unique needs of our diverse client , fostering long-term financial success across various industries and sectors.</p>\r\n', '', '', '', ''),
