INSERT INTO `subcategory` (`id`, `category`, `subcategory`, `photo`, `detail`, `title`, `metatag`, `descp`) VALUES
(2, '3', 'Fixed Deposit', 'Fixed Deposits.jpeg', '<p>\r\n	Fixed deposits involve locking a sum of money for a chosen period, ranging from days to years. In return, they offer a fixed interest rate. At maturity, the depositor receives the principal amount along with accrued interest. They&#39;re highly favored in India, especially by risk-averse middle-class investors.</p>\r\n<p>\r\n	Fixed deposits (FDs) in India are a secure and hassle-free way to invest money, offering good returns. They&#39;re ideal for risk-averse individuals aiming to meet financial goals with guaranteed returns.</p>\r\n<p>\r\n	Fixed deposits (FDs) come with varying investment periods, spanning&nbsp; 7 days to 10 years, depending on the bank. Returns on the invested sum are compounded periodically quarterly, annually, or monthly. Senior citizens typically enjoy 0.5% higher returns than regular investors. While premature and partial withdrawals are often allowed, they might incur penalties. Upon maturity, re-investment of the total amount is an option.</p>\r\n<p>\r\n	<strong>Benefits Of Fixed Deposit</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Great Interest Rates</strong>: Recurring deposits offer better interest rates than regular savings accounts.</li>\r\n	<li>\r\n		<strong>Simple Process</strong>: Opening an RD, especially with the same bank where you have a savings account, doesn&rsquo;t require extra paperwork. It&#39;s hassle-free, linking directly to your existing account</li>\r\n	<li>\r\n		<strong>No Penalties</strong>: Banks have made RDs friendlier by removing penalties for missed payments or early withdrawal, but early withdrawal might not earn the latest interest.</li>\r\n	<li>\r\n		<strong>Flexible Timeframes</strong>: Choose the duration that suits your financial needs.</li>\r\n	<li>\r\n		<strong>Easy to Start</strong>: You can start saving with amounts as low as around Rs 500, depending on the bank.</li>\r\n</ul>\r\n<p>\r\n	<strong>Types Of Fixed Deposit</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Cumulative Fixed Deposits</strong>: These deposits compound interest periodically, adding it to the principal amount. Investors receive the total payout at maturity and can apply for loans or overdraft facilities. Early withdrawals may incur penalties.</li>\r\n	<li>\r\n		<strong>Non-Cumulative Fixed:</strong> Deposits: Investors in these deposits receive interest payouts at regular intervals, ideal for those seeking steady income from their investment.</li>\r\n	<li>\r\n		<strong>Flexi Fixed Deposits</strong>: Combining features of both fixed deposits and savings accounts, these offer high-interest rates while maintaining liquidity. They operate via a sweep-in and sweep-out mechanism, where surplus funds are invested but can be liquidated if savings drop below a set limit.</li>\r\n	<li>\r\n		<strong>Tax-Saving Fixed Deposits</strong>: Banks provide these deposits for tax deductions up to 1.5 lakh annually (under Section 80C of the Income Tax Act). They usually have a compulsory lock-in period of five years.</li>\r\n	<li>\r\n		<strong>Senior Citizen Fixed Deposits</strong>: Tailored for individuals aged 60 and above, these deposits offer higher interest rates compared to regular fixed deposits.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Interest Rates:</strong> Look for an institution offering competitive interest rates on fixed deposits to maximize returns.</li>\r\n	<li>\r\n		<strong>Flexible Tenures:</strong> Choose an institution that provides varied duration options, allowing alignment with your financial objectives.</li>\r\n	<li>\r\n		<strong>Customer Service:</strong> Positive feedback regarding customer service, reliability, and convenience in managing fixed deposits influences many individuals.</li>\r\n	<li>\r\n		<strong>Additional Benefits:</strong> Institutions might offer extra features like online access, loan facilities against deposits, or specialized services for specific customer segments.</li>\r\n	<li>\r\n		<strong>Reputation:</strong> A financial institution&#39;s solid reputation, trustworthiness, and stability play a significant role in the choice for fixed deposits.</li>\r\n</ul>\r\n', '<title>Fixed Deposit</title>', '<meta name=\"title\" content=\"Fixed Deposit\" />', '<meta name=\"description\" content=\"Fixed Deposits are the best way to keep your money safe.\" />'),
(3, '3', 'Recurring Deposit', 'Recurring deposit_15.PNG', '<p>\r\n	Remember those childhood piggy banks, slowly filling with coins and dreams? Recurring Deposits (RDs) offer a similar magic &ndash; watch your savings grow steadily, one small deposit at a time.</p>\r\n<p>\r\n	Hey there! Saving money is like planting seeds for your future. Did you know that starting early is super cool? When you save money when you&#39;re young, it helps you be ready for important things later.</p>\r\n<p>\r\n	But guess what? Even if you&#39;re not super young anymore, you can still start! There&#39;s this thing called Recurring Deposits (RD). It&#39;s like putting away a little bit of your money regularly without making your pocket sad.</p>\r\n<p>\r\n	<strong>Benefits Of Recurring Deposit</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Favorable Interest Rates</strong>: Recurring deposits offer attractive interest rates, often higher than standard savings accounts. Interest is usually compounded periodically, enhancing returns.</li>\r\n	<li>\r\n		<strong>Penalty Waivers</strong>: Missing monthly payments typically incurred penalties in the past, but many institutions now offer penalty-free options for missed installments or premature withdrawals, although the latest interest may not be added upon premature withdrawal.</li>\r\n	<li>\r\n		<strong>Accessible Initial Amount</strong>: RDs allow for modest initial investments, often starting around Rs 500, making them viable for individuals with varying income levels.</li>\r\n	<li>\r\n		<strong>Flexible Tenures</strong>: Tailor the tenure to your financial capability or needs; some institutions offer RDs for short periods, such as six months, catering to short-term investment preferences.</li>\r\n	<li>\r\n		<strong>Simplified Documentation</strong>: Opening an RD can be hassle-free, especially if you already hold a savings account with the same institution. In such cases, no additional paperwork might be necessary, streamlining the process.</li>\r\n</ul>\r\n<p>\r\n	<strong>Here&#39;s why RDs can be your secret weapon:</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Effortless Savings</strong>: Automate your deposits and let your money grow on autopilot. Say goodbye to saving struggles, hello to consistent progress.</li>\r\n	<li>\r\n		<strong>Tailored Growth</strong>: Choose a deposit amount and term that fits your budget and goals, from short-term needs to long-term aspirations.</li>\r\n	<li>\r\n		<strong>Guaranteed Returns</strong>:Enjoy predictable interest rates, shielding your savings from market volatility and ensuring steady growth.</li>\r\n	<li>\r\n		<strong>Discipline Booster</strong>: Regular deposits instill a healthy savings habit, helping you reach your financial dreams faster.</li>\r\n	<li>\r\n		<strong>Power of Compounding</strong>: Watch your money snowball as interest accumulates on your interest, maximizing your returns over time.</li>\r\n</ul>\r\n<p>\r\n	<strong>RDs are ideal for:</strong></p>\r\n<ul>\r\n	<li>\r\n		Building an emergency fund for unexpected expenses.</li>\r\n	<li>\r\n		Saving for education, travel, or other personal goals.</li>\r\n	<li>\r\n		Accumulating a down payment for your dream home.</li>\r\n	<li>\r\n		Supplementing your retirement corpus for a secure future.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Interest Rates</strong>: Aadeeshwara may offer competitive interest rates on their recurring deposit accounts, potentially higher than other institutions, leading to better returns on savings.</li>\r\n	<li>\r\n		<strong>Flexibility in Terms</strong>: They might provide flexible tenure options, allowing individuals to choose durations that suit their financial goals, whether short-term or long-term.</li>\r\n	<li>\r\n		<strong>No or Low Penalties</strong>: Aadeeshwara could have favorable terms regarding missed payments or early withdrawals, potentially offering waivers or lower penalties.</li>\r\n	<li>\r\n		<strong>Customer Service</strong>: Good customer service is crucial. Aadeeshwara might offer excellent support and assistance, making the process of opening and managing a recurring deposit account smooth and hassle-free.</li>\r\n	<li>\r\n		<strong>Additional Benefits</strong>: The institution might offer added benefits such as ease of account management, online access, or integration with other financial products.</li>\r\n</ul>\r\n', '', '', ''),
(7, '2', 'Life Insurance', 'insurance-insofy.png', '<p>\r\n	Life insurance is a crucial financial contract between an individual and an insurance company. This agreement guarantees a designated sum of money, known as the death benefit, to be paid to named beneficiaries upon the insured person&#39;s demise. In exchange for this coverage, the policyholder pays regular premiums to the insurance company.</p>\r\n<p>\r\n	<strong>Benefits of Life Insurance</strong></p>\r\n<p>\r\n	Life insurance offers numerous advantages, providing financial security and reassurance for both policyholders and beneficiaries. Some notable benefits include:</p>\r\n<ul>\r\n	<li>\r\n		<strong>Financial Protection</strong>: Life insurance offers a lump-sum payment to replace lost income, cover living expenses, settle debts, and support future financial goals for dependents after the insured&#39;s death.</li>\r\n	<li>\r\n		<strong>Estate Planning and Inheritance:</strong> It helps in estate tax payments and ensures fair distribution among beneficiaries, maintaining the intended assets for heirs.</li>\r\n	<li>\r\n		<strong>Final Expenses Coverage</strong>: Life insurance assists in covering funeral costs and other end-of-life expenses, easing the financial burden for family members.</li>\r\n	<li>\r\n		<strong>Loan Protection</strong>: Certain policies aid in paying off outstanding loans or debts, ensuring financial obligations are met in case of the insured&#39;s death.</li>\r\n	<li>\r\n		<strong>Tax Advantages</strong>: The death benefit is generally tax-free, and some policies offer tax-deferred cash value accumulation, fostering tax-advantaged savings.</li>\r\n	<li>\r\n		<strong>Supplemental Retirement Income</strong>: Permanent life insurance policies accumulate cash value over time, providing accessible funds for supplemental retirement income or financial flexibility.</li>\r\n	<li>\r\n		<strong>Peace of Mind</strong>: Having life insurance ensures that loved ones will have financial protection and support after the insured&#39;s death, offering peace of mind.</li>\r\n</ul>\r\n<p>\r\n	<strong>Types of Life Insurance</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Term Life Insurance</strong>: Offers coverage for a specific period and is more affordable than permanent life insurance.</li>\r\n	<li>\r\n		<strong>Whole Life Insurance</strong>: Provides lifelong coverage with a cash value component that grows over time.</li>\r\n	<li>\r\n		<strong>Universal Life Insurance</strong>: Offers flexibility in premium payments and adjustments to death benefit and cash value accumulation.</li>\r\n	<li>\r\n		<strong>Variable Life Insurance</strong>: Combines life insurance coverage with an investment component, allowing policyholders to invest premiums in various sub-accounts.</li>\r\n	<li>\r\n		<strong>Indexed Universal Life Insurance</strong>: Tied to a stock market index, providing potential for higher returns but subject to market fluctuations.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		Assess coverage needs based on debts, future expenses, and income replacement.</li>\r\n	<li>\r\n		Choose a suitable policy type aligning with financial goals and affordability.</li>\r\n	<li>\r\n		Consider health, age, and premiums while selecting a policy.</li>\r\n	<li>\r\n		Opt for a financially stable insurer with a strong rating.</li>\r\n</ul>\r\n', '', '', ''),
(20, '3', 'Mutual Funds ', 'Mutual Funds_16.jpeg', '<p>\r\n	A mutual fund is a type of investment vehicle that pools money from multiple investors to invest in a diversified portfolio of stocks, bonds, money market instruments, or other securities. These funds are managed by professional fund managers or investment firms who make investment decisions on behalf of the investors.</p>\r\n<p>\r\n	<strong>Benefits Of Mutual Funds</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Diversification:</strong> Spread investment across various asset classes to reduce risk. For example, equity-oriented funds typically have a mix of stocks and debt securities.</li>\r\n	<li>\r\n		<strong>Professional Management:</strong> Benefit from expert fund managers who continually monitor and adjust the portfolio for optimal performance.</li>\r\n	<li>\r\n		<strong>Tax Benefits:</strong> Certain mutual funds offer tax deductions, such as Equity-Linked Saving Schemes (ELSS) qualifying for deductions under Section 80C of the Income Tax Act.</li>\r\n	<li>\r\n		<strong>High Liquidity:</strong> Easily sell mutual fund holdings to meet financial needs, with some funds offering instant redemption for quick access to funds.</li>\r\n	<li>\r\n		<strong>Higher Return on Investment: </strong>Potential for higher returns over time due to the ability to invest in a diverse range of sectors and industries, helping beat inflation and grow wealth in the long term.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why should you invest in Mutual Funds?</strong></p>\r\n<p>\r\n	There are various reason to invest in mutual funds some of them are:</p>\r\n<ul>\r\n	<li>\r\n		<strong>Low Investment Cost:</strong> Mutual funds&nbsp; are low-cost and high returns giving investments. Especially with SIPs, it becomes affordable for many people where they can start their investment with an amount as low as Rs. 500.</li>\r\n	<li>\r\n		<strong>Tax Savings:</strong> By investing in tax-saving mutual funds called ELSS which qualify for tax deduction up to Rs 1.5 lakh per annum under Section 80C of the Income Tax Act, 1961. Though a 10% tax on Long-Term Capital Gains (LTCG) above Rs 1 lakh is applicable, they have consistently delivered higher returns than other tax-saving instruments in recent years.</li>\r\n	<li>\r\n		<strong>Diversification :</strong> Mutual funds help provide instant diversification since they invest across dozens or sometimes hundreds of individual stocks, bonds, or other securities.For example, when the market is volatile, one poor performing stock may be smoothed out by other stocks that are performing well in the same index, which may help reduce the risk to your overall portfolio than if you were invested in only one stock.</li>\r\n	<li>\r\n		<strong>Safety:</strong>&nbsp; In India, the mutual fund industry is regulated by the capital market regulator Securities and Exchange Board of India (SEBI). Therefore, mutual funds must follow stringent rules and regulations, ensuring investor protection, risk mitigation, liquidity, and fair valuation.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Track Record:</strong> Aadeeshwara might have a consistent and impressive track reco in managing mutual funds, showcasing good performance over the years.</li>\r\n	<li>\r\n		<strong>Expertise:</strong> They may have a team of experienced and skilled fund managers who make sound investment decisions, attracting investors seeking professional management.</li>\r\n	<li>\r\n		<strong>Diverse Offerings:</strong> Aadeeshwara might offer a diverse range of mutual funds catering to different risk appetites and investment goals, providing options for various types of investors.</li>\r\n	<li>\r\n		<strong>Transparency:</strong> Aadeeshwara might prioritize transparency in their operations, providing clear information about fund performance, fees, and investment strategies.</li>\r\n	<li>\r\n		<strong>Customer Service: </strong>They might offer excellent customer service, aiding investors with queries, providing regular updates, and offering support when needed.</li>\r\n	<li>\r\n		<strong>Innovation:</strong> Aadeeshwara might stand out for innovative fund offerings or strategies that attract investors looking for unique investment opportunities.</li>\r\n</ul>\r\n', '', '', ''),
(21, '3', 'Corporate Fixed Deposit ', 'Corporate insurance _16.jpeg', '<p>\r\n	A company fixed deposit, also called a corporate fixed deposit, is like a savings plan offered by certain non-banking companies, manufacturers, and housing finance firms. It&#39;s a trusted way to grow your money smoothly and is regulated by a law called Section 58 A in the Companies Act of 2013.</p>\r\n<p>\r\n	<strong>Why Should you Invest in Corporate FDs ?</strong></p>\r\n<p>\r\n	Fixed Deposits are common and favorite deposits for investors who want returns regularly. Most people think of banks when they hear the term Fixed Deposits, but there is also a better option in FDs apart from banks. These are known as Corporate FDs, and they offer higher interest rates compared to the banks. However, these are unsecured and are not backed by any collateral.</p>\r\n<p>\r\n	The investor invests a lump sum amount of money in a fixed deposit and then receives interest periodically till the Fixed Deposit is matured. Here, maturity is a specific period for which an investor invests money. Bank FDs are the most popular, but much like banks, other institutions can also collect money in Fixed Deposits. A few such as corporates, NBFCs, and financial institutions raise money for their present or forthcoming operations.</p>\r\n<p>\r\n	Before investing in Corporate Fixed Deposits, it is important to understand how corporate FDs work.</p>\r\n<p>\r\n	<strong>How Corporate FD&rsquo;s Work ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Fund Collection:</strong> Corporates gather money from individuals through Fixed Deposits for a set duration.</li>\r\n	<li>\r\n		<strong>Utilization of Funds:</strong> The collected money is then used by the company for its financial and production operations during that specific period.</li>\r\n	<li>\r\n		<strong>Interest Payment:</strong> Each individual who invested in the Fixed Deposit receives a fixed interest rate from the company for the duration of the deposit.</li>\r\n	<li>\r\n		<strong>Capital Raising:</strong> Corporate FDs make it easier for companies to raise capital for their operations since these deposits act as unsecured loans.</li>\r\n	<li>\r\n		<strong>Longer Duration:</strong> Corporate FDs generally have longer durations compared to other investment options, providing investors with the opportunity for longer-term investments.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Credibility and Trustworthiness:</strong> We could have a strong reputation and credibility in managing corporate FDs, instilling trust among investors.</li>\r\n	<li>\r\n		<strong>Competitive Interest Rates:</strong> They might offer attractive and competitive interest rates on corporate FDs, potentially providing better returns for investors.</li>\r\n	<li>\r\n		<strong>Transparent Processes:</strong> We could have transparent and clear procedures for managing corporate FDs, ensuring investors understand the terms and conditions.</li>\r\n	<li>\r\n		<strong>Reliable Returns:</strong> They might have a history of delivering consistent and reliable returns on corporate FDs, which is appealing to investors seeking stability.</li>\r\n	<li>\r\n		<strong>Interest Payment :</strong> Each individual who invested in the Fixed Deposit receives a fixed interest rate from the company for the duration of the deposit.</li>\r\n</ul>\r\n', '', '', ''),
(22, '3', 'Initial Public Offering ', 'IPO_15.jpeg', '<p>\r\n	An IPO, or Initial Public Offering, is when a company goes from being privately owned to selling shares to the public for the first time. This helps the company raise money, and it lets regular people buy a piece of the company by purchasing its shares. It&#39;s like the company inviting everyone to become a part-owner by selling parts of itself in the form of shares.</p>\r\n<p>\r\n	<strong>Types Of Initial Public offering</strong></p>\r\n<p>\r\n	<strong>1.&nbsp;Fixed Price Offering :</strong></p>\r\n<ul>\r\n	<li>\r\n		Company sets a fixed price for its stocks right from the start.</li>\r\n	<li>\r\n		Buyers pay that set price per share when purchasing stocks.</li>\r\n	<li>\r\n		No bidding or price range, it&#39;s a set amount for everyone.</li>\r\n</ul>\r\n<p>\r\n	<strong>2. BOOK BUILDING IPO :</strong></p>\r\n<ul>\r\n	<li>\r\n		Company sets a price range for its upcoming IPO.</li>\r\n	<li>\r\n		The range has a minimum (floor price) and a maximum (cap price).</li>\r\n	<li>\r\n		Investors then bid for the shares within this range.</li>\r\n	<li>\r\n		The final price is determined based on these bids, often through surveys and analysis.</li>\r\n	<li>\r\n		Selected investors within this bidding process receive the stocks.</li>\r\n</ul>\r\n<p>\r\n	<strong>Benefits Of Initial Public Offering</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Public Investment Opportunity:</strong> IPOs allow regular people to invest in new businesses or projects.</li>\r\n	<li>\r\n		<strong>Simplified Company Acquisition:</strong> IPOs make it easier for companies to be bought or merged.</li>\r\n	<li>\r\n		<strong>Enhanced Visibility and Reputation:</strong> Going public through an IPO increases a company&#39;s visibility and reputation.</li>\r\n	<li>\r\n		<strong>Improved Transparency:</strong> Companies going public must report their performance regularly, which makes their operations more transparent.</li>\r\n	<li>\r\n		<strong>Better Borrowing Conditions:</strong> Companies that have had an IPO often get better loan terms compared to private firms.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Expertise and Reputation:</strong> We might have a strong track record and expertise in handling IPOs, ensuring a smoother and more successful process.</li>\r\n	<li>\r\n		<strong>Market Understanding:</strong> We&nbsp; could have a deep understanding of the market conditions, enabling them to time the IPO for maximum benefit.</li>\r\n	<li>\r\n		<strong>Investor Relations:</strong> We might have established relationships with potential investors, aiding in securing funding during the IPO.</li>\r\n	<li>\r\n		<strong>Advisory Services:</strong> They might offer valuable advice and guidance throughout the IPO journey, helping the company navigate regulatory requirements and make informed decisions.</li>\r\n	<li>\r\n		<strong>Customized Approach:</strong> We might offer tailored solutions to meet the specific needs and goals of the company going public, ensuring a more personalized IPO experience.</li>\r\n</ul>\r\n', '', '', ''),
(24, '1', 'Credit Card', 'credit card.PNG', '<p>\r\n	A credit card is a financial tool that allows individuals to borrow funds up to a certain limit for purchases, which need to be repaid within a specified time frame. It&#39;s a form of revolving credit offered by financial institutions.</p>\r\n<p>\r\n	<strong>Benefits of Credit Card</strong>&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<ul>\r\n	<li>\r\n		<strong>Automated Payments:</strong>&nbsp;Set up recurring payments for bills to avoid penalties or disconnection.</li>\r\n	<li>\r\n		<strong>Online Access</strong>: Pay for flights, phone recharges, and more online.</li>\r\n	<li>\r\n		<strong>Interest-Free Period:</strong>&nbsp;Enjoy a grace period of up to 50 days without interest charges.</li>\r\n	<li>\r\n		<strong>Rewards System:</strong>&nbsp;Earn points on purchases, redeem for gifts or flights.</li>\r\n	<li>\r\n		<strong>Cashbacks and Discounts:</strong>&nbsp;Access exclusive offers and points with selected merchants.</li>\r\n</ul>\r\n<p>\r\n	<strong>&nbsp;Why Are Credit Cards Important?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Convenience:&nbsp;</strong>They provide a convenient way to make purchases, both in-store and online, without carrying cash.</li>\r\n	<li>\r\n		<strong>Building Credit:</strong>&nbsp;Responsible use of credit cards can positively impact your credit score, which is crucial for future financial endeavors like loans or mortgages.</li>\r\n	<li>\r\n		<strong>Emergency Funds:</strong>&nbsp;Credit cards can serve as a financial cushion during emergencies when immediate funds are needed.</li>\r\n	<li>\r\n		<strong>Rewards and Benefits:</strong>&nbsp;Many credit cards offer rewards programs, cashback incentives, or travel perks, adding value to your purchases.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Transparent Terms :&nbsp;</strong>Our business partner&nbsp; credit cards come with clear terms and conditions, ensuring users understand their financial responsibilities.</li>\r\n	<li>\r\n		<strong>Competitive Rates:&nbsp;</strong>They offer competitive interest rates and fees compared to other providers.</li>\r\n	<li>\r\n		<strong>Tailored Solutions:&nbsp;&nbsp;</strong>We customizes credit card offerings to suit various financial needs, whether for frequent travelers, cashback enthusiasts, or those building credit.</li>\r\n</ul>\r\n', '', '', ''),
(26, '1', 'Education Loan', 'Education_loan _12.png', '<p>\r\n	An education loan is a sum of money borrowed to finance post-secondary education or higher education-related expenses. Education loans are intended to cover the cost of tuition, books and supplies, and living expenses while the borrower is in the process of pursuing a degree. Payments are often deferred while students are in college and, depending on the lender, for an additional six-month period after earning a degree. This deferment period is also referred to as a &quot;grace period.</p>\r\n<p>\r\n	<strong>Types Of Education Loan</strong></p>\r\n<p>\r\n	Although there are a variety of education loans, they can be broken down generally into two basic types: federal loans (sponsored by the federal government) and private loans</p>\r\n<p>\r\n	<strong>Federal Loans</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Federal Student Loans:</strong>&nbsp;Sponsored by the government, obtained through the FAFSA without a credit check.</li>\r\n	<li>\r\n		<strong>FAFSA Application:</strong>&nbsp;Completing the FAFSA helps determine eligibility and the amount based on school costs.</li>\r\n	<li>\r\n		<strong>Loan Types:</strong>&nbsp;Includes direct subsidized, direct unsubsidized, and direct consolidation loans.</li>\r\n	<li>\r\n		<strong>Disbursement:</strong>&nbsp;Funds are sent to the school; surplus funds might be issued to the student for other expenses.</li>\r\n	<li>\r\n		<strong>Interest Coverage:</strong>&nbsp;Subsidized loans cover interest while in school; unsubsidized loans defer interest during enrollment and good academic standing.</li>\r\n</ul>\r\n<p>\r\n	<strong>Private Loans</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Supplemental to Federal Aid:</strong>&nbsp;Students might consider private loans if federal aid isn&#39;t enough, suggested sometimes in federal loan packages.</li>\r\n	<li>\r\n		<strong>Types of Private Loans:&nbsp;</strong>Include those from private lenders, state-related nonprofits, and institutional loans from schools.</li>\r\n	<li>\r\n		<strong>Application Process:&nbsp;</strong>Typically involves a standard private-sector loan application, which often requires a credit check.</li>\r\n	<li>\r\n		<strong>Direct Application:&nbsp;</strong>Borrowers apply directly to private lenders, and the loan amount is influenced by the attending school.</li>\r\n	<li>\r\n		<strong>Disbursement:</strong>&nbsp;Funds initially cover school expenses; any surplus is sent directly to the borrower for educational costs.</li>\r\n</ul>\r\n<p>\r\n	<strong>Benefits Of Education Loan</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Low Interest Rates:&nbsp;</strong>Study loans often offer lower interest rates, especially from public sector banks, with potential government subsidies for underprivileged backgrounds.</li>\r\n	<li>\r\n		<strong>Easy Availability:&nbsp;</strong>Accessible from various sources including banks (public and private), NBFCs, and organizations offering simplified processes.</li>\r\n	<li>\r\n		<strong>Flexible Repayment:</strong>&nbsp;Banks often provide flexible repayment options, considering future earnings, making it easier for students to repay after securing employment.</li>\r\n	<li>\r\n		<strong>Tax Benefits:</strong>&nbsp;Interest paid on education loans is tax deductible under Section 80E of the Income Tax Act, offering financial relief during the repayment phase.</li>\r\n	<li>\r\n		<strong>Promoting Self-Responsibility:&nbsp;</strong>Encourages self-dependence by easing the financial burden on parents and instilling commitment to studies by investing in their education through a loan.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Quick Approval:&nbsp;</strong>Streamlined processes for faster approval, ensuring timely access to funds for education expenses.</li>\r\n	<li>\r\n		<strong>Transparent Practices:</strong>&nbsp;We prioritizes transparency in loan terms, ensuring clarity about conditions and repayment schedules.</li>\r\n	<li>\r\n		<strong>Expert Guidance:&nbsp;</strong>Professional guidance and support throughout the loan application process for students and their families.</li>\r\n	<li>\r\n		<strong>Customized Solutions:</strong>&nbsp;Personalized loan solutions to cater to specific educational requirements and eligibility criteria.</li>\r\n	<li>\r\n		<strong>Accessibility:&nbsp;</strong>We extends education loan solutions to various student segments, ensuring accessibility to education financing.</li>\r\n</ul>\r\n', '', '', ''),
(28, '1', 'Auto Loan', 'Auto loan _15.PNG', '<p>\r\n	An auto loan is a type of financial arrangement specifically designed to assist individuals in purchasing vehicles, such as cars, motorcycles, boats, or other modes of transportation. This loan enables individuals to acquire a vehicle by borrowing money from a lender, typically a bank, credit union, or financial institution.</p>\r\n<p>\r\n	<strong>Benefits Of Auto Loan</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Purpose:</strong>&nbsp;A car loan assists in buying either a new or a pre-owned vehicle.</li>\r\n	<li>\r\n		<strong>Financing:</strong>&nbsp;Lenders typically offer 90% to 75% financing for new and used cars respectively (sometimes up to 100% for specific models).</li>\r\n	<li>\r\n		<strong>Loan Duration:&nbsp;</strong>Car loan tenure ranges from 1 to 7 years.</li>\r\n	<li>\r\n		<strong>Quick Financing:</strong>&nbsp;Eligible candidates can often receive instant loan approval from most lenders.</li>\r\n	<li>\r\n		<strong>Dealer Tie-Ups:</strong>&nbsp;Banks collaborating with dealers or manufacturers may provide discounts to borrowers buying from these specific sources.</li>\r\n</ul>\r\n<p>\r\n	<strong>Different types of auto loans in india</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>New Car Loan:&nbsp;</strong>Borrow for purchasing a brand-new vehicle, offering diverse loan options, competitive interest rates, and associated benefits.</li>\r\n	<li>\r\n		<strong>Pre-owned Car Loan (Used Car Loan):</strong>&nbsp;Access financing for buying second-hand vehicles, generally at lower funding levels compared to new car loans.</li>\r\n	<li>\r\n		<strong>Loan against Car:</strong>&nbsp;Secure loans without collateral for new or used cars, ranging from 75% to 100% financing, minimal documentation, attractive interest rates, and no foreclosure charges.</li>\r\n</ul>\r\n<p>\r\n	<strong>Differentiating Factors</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Promotional Offer for Electric Vehicles:</strong>&nbsp;Some lenders offer concessions on interest rates to promote Electric Vehicle purchases.</li>\r\n	<li>\r\n		<strong>Documentation and Interest Rates</strong>: Minimal documentation, attractive rates, and no foreclosure charges for loans against cars.</li>\r\n	<li>\r\n		<strong>Comparison of New vs. Used Car Loans:</strong>&nbsp;Evaluate new and used car loans, offering competitive rates, repayment periods up to 7 years, and considerations for higher credit scores for interest rate adjustments.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Competitive Rates:</strong>&nbsp;We provides competitive interest rates for auto loans, ensuring affordability.</li>\r\n	<li>\r\n		<strong>Flexible Options:</strong>&nbsp;Tailored loan options to suit individual needs and preferences.</li>\r\n	<li>\r\n		<strong>Quick Approval:&nbsp;</strong>Swift approval processes ensure faster access to funds when purchasing a vehicle.</li>\r\n	<li>\r\n		<strong>Transparent Practices:&nbsp;</strong>Our prioritizes transparency in terms, conditions, and processes related to auto loans.</li>\r\n	<li>\r\n		<strong>Expert Guidance:</strong>&nbsp;Professional guidance and support throughout the loan application process for clarity and assistance</li>\r\n</ul>\r\n', '', '', ''),
(30, '2', 'Term Insurance ', 'Term_Insurance_12 (1).png', '<p>\r\n	Term life insurance is a straightforward yet powerful financial tool designed to provide coverage for a specific period, known as the &quot;term.&quot; In the event of the policyholder&#39;s demise during the term, the insurance company pays out a predetermined sum, known as the death benefit, to the beneficiaries. This coverage serves as a safety net, ensuring that your loved ones are financially secure if the unexpected were to happen.</p>\r\n<p>\r\n	<strong>The Necessity of Term Life Insurance</strong></p>\r\n<p>\r\n	<strong>Peace of Mind:</strong>&nbsp;Provides peace of mind by ensuring your loved ones are financially protected, even if you&#39;re no longer there to provide for them.</p>\r\n<p>\r\n	Scenario Assistance:In the event of the unexpected, term life insurance steps in to ease the financial burden, allowing your family to maintain their quality of life and pursue dreams without strain.</p>\r\n<p>\r\n	<strong>Benefits of Term Insurance</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>High Insurance Coverage</strong>: Term insurance plans are recognized for offering substantial insurance coverage.</li>\r\n	<li>\r\n		<strong>Affordable Premiums:</strong>&nbsp;These plans are characterized by their affordability in terms of premiums. You can secure the future of your family with significant coverage against nominal premium amounts.</li>\r\n	<li>\r\n		<strong>Preferred Choice</strong>: The affordability of term insurance plans makes them a favored and popular choice among individuals.Many opt for these plans due to the combination of high coverage and reasonable premium costs.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Tailored Coverage:</strong>&nbsp;Their term life insurance policies are meticulously tailored to fit your specific needs and financial circumstances, ensuring comprehensive coverage during the chosen term.</li>\r\n	<li>\r\n		<strong>Financial Security:</strong>Our policies offer a robust financial safety net for your loved ones, ensuring they are taken care of in case of any unfortunate event.</li>\r\n	<li>\r\n		<strong>Expert Guidance</strong>: Our team of insurance experts provides personalized assistance, guiding you through the process of choosing the most suitable policy that aligns with your requirements.</li>\r\n	<li>\r\n		<strong>Customer-Centric Approach</strong>: We&nbsp; prioritizes their clients&#39; needs, offering dedicated support and assistance throughout the term life insurance journey.</li>\r\n	<li>\r\n		<strong>Reputation and Trust</strong>: With a strong reputation and a track record of reliability, Aadeeshwara Fintech instills trust and confidence in their client.</li>\r\n</ul>\r\n', '', '', ''),
(31, '2', 'Group Insurance ', 'group.jpeg', '<p>\r\n	Group insurance refers to insurance coverage offered to individuals within a structured group, such as employees within a company or members of an association. It stands apart from individual insurance, where policies are sold to individuals individually, and from government-sponsored social insurance (like unemployment insurance or social security).</p>\r\n<p>\r\n	<strong>Eligibility Criteria Of Group Insurance</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Group Size:</strong>&nbsp;A minimum of 10 members is typically required to establish a qualifying group for Group Insurance purposes.</li>\r\n	<li>\r\n		<strong>Commonality:</strong>&nbsp;Group members must share common traits, such as working for the same employer, belonging to a specific association, or having similar professions.</li>\r\n	<li>\r\n		<strong>Participation:</strong>&nbsp;All eligible group members must actively take part in the insurance plan to ensure risk distribution across the entire group.</li>\r\n	<li>\r\n		<strong>Underwriting:</strong>&nbsp;Group Insurance policies might necessitate underwriting procedures to evaluate the risk associated with insuring the group.</li>\r\n	<li>\r\n		<strong>Contribution:</strong>&nbsp;The premium for Group Insurance is commonly divided between the employer and employees, and all members of the group are required to contribute.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Group Insurance Needed ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Cost Efficiency:</strong>&nbsp;Group Insurance is cost-effective as the risk is distributed among a larger group, making it generally more affordable compared to individual policies.</li>\r\n	<li>\r\n		<strong>Employee Attraction and Retention:&nbsp;</strong>It serves as an attractive employee benefit, aiding companies in attracting and retaining top talent.</li>\r\n	<li>\r\n		<strong>Coverage for Pre-Existing Conditions:&nbsp;</strong>Group Insurance often includes coverage for pre-existing conditions that individual policies might exclude.</li>\r\n	<li>\r\n		<strong>Comprehensive Benefits:</strong>&nbsp;It typically offers comprehensive coverage, including medical, dental, vision, and other benefits not always included in individual policies.</li>\r\n	<li>\r\n		<strong>Financial Security:</strong>&nbsp;Group Insurance provides financial security for employees and their families during unexpected events like illness, injury, or death.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Customized Plans:</strong>&nbsp;We offers tailored group insurance plans that can be adapted to the specific needs of your group, whether it&#39;s a company, association, or organization</li>\r\n	<li>\r\n		<strong>Comprehensive Coverage:&nbsp;</strong>Our&nbsp; insurance plans often encompass a wide range of benefits, including medical, dental, vision, and other essential coverages, ensuring comprehensive protection for group members.</li>\r\n	<li>\r\n		<strong>Competitive Pricing:</strong>&nbsp;We may provide cost-effective group insurance options by spreading the risk across a larger group, resulting in potentially lower premiums compared to individual policies.</li>\r\n	<li>\r\n		<strong>Experience and Expertise:</strong>&nbsp;Their experience in the insurance industry and expertise in group insurance might ensure efficient handling of policies, claims, and customer service.</li>\r\n	<li>\r\n		<strong>Support and Assistance:</strong>&nbsp;We may offer robust customer support, aiding in understanding policy details, facilitating claims, and providing assistance throughout the insurance period.</li>\r\n</ul>\r\n', '', '', ''),
(32, '2', 'Health Insurance', 'Health insurance _15.PNG', '<p>\r\n	Health insurance is a vital contract between the insured and the insurer, ensuring financial protection up to the sum insured limit. This insurance coverage encompasses various healthcare expenses incurred during emergencies or planned hospital stays. Not only does it provide crucial medical coverage, including hospitalization and day care procedures, but it also extends to critical illnesses.</p>\r\n<p>\r\n	<strong>Why Health Insurance Is Mandatory For You ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Protecting Your Family</strong>: Keeping your family safe and healthy is your top priority. A solid health insurance plan is one of the best ways to ensure their well-being and financial security.</li>\r\n	<li>\r\n		<strong>Tackling Rising Healthcare Costs</strong>&nbsp;: Medical expenses keep rising, making quality care hard to afford. Health insurance acts as a safety net, shielding you from overwhelming medical bills during emergencies.</li>\r\n	<li>\r\n		<strong>Better Coverage Than Savings Alone</strong>&nbsp;: Even if you&#39;ve saved for healthcare, it might not be enough for costly treatments. Health insurance provides broader coverage, safeguarding your savings from being depleted by unexpected medical expenses.</li>\r\n	<li>\r\n		<strong>Seizing Benefits While Young</strong>: Buying insurance early saves you money. As you age, health risks increase, affecting insurance costs. Lock in lower premiums and better coverage by getting insured while you&#39;re young and healthy.</li>\r\n</ul>\r\n<p>\r\n	<strong>What Does Health Insurance Includes&nbsp;</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>In-Patient Hospitalization:</strong>&nbsp;Treatment, room charges, ICU expenses during hospital stays.</li>\r\n	<li>\r\n		<strong>Pre-Hospitalization:</strong>&nbsp;Costs before admission, like tests and consultations.</li>\r\n	<li>\r\n		<strong>Post-Hospitalization:</strong>&nbsp;Follow-up visits, tests, and rehab after discharge.</li>\r\n	<li>\r\n		<strong>Organ Donor Hospitalization:&nbsp;</strong>Surgery and hospital expenses for organ donors are often covered.</li>\r\n</ul>\r\n<p>\r\n	<strong>Type Of Health Insurance&nbsp;</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Individual Health Insurance</strong>: Tailored for You Get customized medical coverage that suits your specific needs. From surgery costs to pre and post-medical expenses, individual health insurance gives you flexibility and control over your coverage.</li>\r\n	<li>\r\n		<strong>Family Floater Health Insurance:</strong>&nbsp;One for All Cover your entire family under one policy and share the sum insured. Enjoy the convenience of a single premium payment and potentially lower premiums compared to individual policies.</li>\r\n	<li>\r\n		<strong>Senior Citizen Health Insurance</strong>: Care for Elders&nbsp; Specifically designed for those above 60, this insurance covers medical expenses for seniors, including hospitalization, accident-related damages, and more, addressing their higher health risks.</li>\r\n	<li>\r\n		<strong>Group Health Insurance</strong>: Employer&#39;s Shield Offered by employers, these plans protect employees against various health issues. Affordable premiums and comprehensive coverage make this an attractive benefit.</li>\r\n	<li>\r\n		<strong>Maternity Health Insurance:</strong>&nbsp;Embracing Parenthood&nbsp; Prepare for parenthood without financial worries. Covering delivery, pre/postnatal care, and even expenses for the newborn, this plan lets you focus on the joys of becoming a parent.</li>\r\n	<li>\r\n		<strong>Top-Up &amp; Super Top-Up Health Insurance</strong>: Extra Protection Extend your existing coverage with these plans. They bridge the gap between your current insurance and additional medical expenses, ensuring comprehensive protection.</li>\r\n</ul>\r\n<p>\r\n	<strong>Key Points to Note:</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Network Hospitals:</strong>&nbsp;Check your insurer&#39;s list of network hospitals to know where cashless facilities are available.</li>\r\n	<li>\r\n		<strong>Required Documents:</strong>&nbsp;Keep invoices, medical reports, prescriptions, and claim forms handy for smooth processing.</li>\r\n	<li>\r\n		<strong>Policy Coverage:</strong>&nbsp;Understand your policy&#39;s coverage limits, deductibles, waiting periods, and exclusions for a hassle-free claim process.</li>\r\n	<li>\r\n		<strong>Timely Filing:</strong>&nbsp;Submit claims within the stipulated time frame to ensure prompt processing.</li>\r\n</ul>\r\n', '', '', ''),
(33, '2', 'Travel Insurance', 'Travel insurance _15.PNG', '<p>\r\n	Travel insurance is your essential safeguard for unexpected emergencies during trips, offering financial protection and peace of mind.Travel insurance is a type of insurance that is custom-made for people going on domestic and international travels.</p>\r\n<p>\r\n	<strong>Benefits Of Travel Insurance ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Medical Emergencies:</strong>&nbsp;It&rsquo;s your guardian angel in unfamiliar territories. Covers medical expenses if you fall ill or get injured during your trip.</li>\r\n	<li>\r\n		<strong>Trip Interruptions/Cancellations:</strong>&nbsp;Unexpected changes? Travel insurance reimburses expenses for canceled or interrupted trips due to emergencies.</li>\r\n	<li>\r\n		<strong>Lost Luggage/Property:&nbsp;</strong>Misplaced baggage? Don&#39;t worry; your insurance helps replace lost or stolen belongings.</li>\r\n	<li>\r\n		<strong>Emergency Evacuations:</strong>&nbsp;In dire situations, it covers emergency evacuations ensuring your safe return home.</li>\r\n</ul>\r\n<p>\r\n	<strong>Types Of Travel&nbsp; Insurance</strong></p>\r\n<p>\r\n	<strong>Domestic Travel Insurance:</strong>&nbsp;Domestic travel insurance is a financial protection plan designed to cover unforeseen events and risks while traveling within one&#39;s own country. It offers coverage for various incidents such as trip cancellations, medical emergencies, loss of baggage, and other travel-related disruptions, providing financial assistance and support during domestic trip.</p>\r\n<ul>\r\n	<li>\r\n		Comprehensive Protection</li>\r\n	<li>\r\n		Medical Coverage</li>\r\n	<li>\r\n		Trip Assurance</li>\r\n	<li>\r\n		Baggage Security</li>\r\n	<li>\r\n		24/7 Support</li>\r\n</ul>\r\n<p>\r\n	<strong>International Travel Insurance :&nbsp;</strong>International Travel Insurance intends to accompany you on all your travels and assist you in traveling more wisely. We cover everything from unexpected flight delays and missed connections to loss of belongings, medical emergencies, and adventure sports ouches so that nothing takes away your peace of mind.</p>\r\n<ul>\r\n	<li>\r\n		Hassle-free cashless claim settlement</li>\r\n	<li>\r\n		Region specific plans to suit your needs</li>\r\n	<li>\r\n		Business class up-gradation.&nbsp;&nbsp;</li>\r\n	<li>\r\n		Coverage for emergency conditions due to pre-existing illnesses</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Comprehensive Coverage:</strong>&nbsp;We provides extensive coverage for various travel-related incidents, including trip cancellations, medical emergencies, baggage loss, and more, ensuring comprehensive protection during your travels.</li>\r\n	<li>\r\n		<strong>Customized Plans:&nbsp;</strong>They offer customizable plans tailored to fit different travel needs, allowing you to select coverage options that match your specific requirements and budget.</li>\r\n	<li>\r\n		<strong>24/7 Assistance:</strong>&nbsp;We&nbsp; provides round-the-clock support, ensuring assistance and guidance whenever you need it, no matter the time zone or location of your travel.</li>\r\n	<li>\r\n		<strong>Quick and Hassle-Free Claims:</strong>&nbsp;Our efficient and straightforward claims process makes it easier for travelers to file and receive reimbursements for covered incidents, minimizing the hassle during unforeseen events.</li>\r\n	<li>\r\n		<strong>Reputation for Reliability:</strong>&nbsp;Aadesshwara is known for its reliability and customer-centric approach, earning trust through quality service and prompt assistance, enhancing peace of mind during your travels.</li>\r\n</ul>\r\n', '', '', '');
