(38, '1', 'Home Loan', 'Home Loan.png', '<p>\r\n	Buying a house is one of the biggest dreams come true for most people and an extravagant affair altogether. Imparting life to such a dream requires a lot of effort from the buyers&rsquo; end and the best one can do to accommodate the home in their budget is through a home loan.</p>\r\n<p>\r\n	A home loan can be opted to buy a new house/flat or a plot of land where you construct the house, and even for renovation, extension, and repairs to an existing house.</p>\r\n<p>\r\n	<strong>Types of Home Loans in India</strong></p>\r\n<p>\r\n	<strong>Home Loan</strong></p>\r\n<p>\r\n	This is the most common type of home loan availed to purchase a house. There are many housing finance companies, public banks, and private banks that offer housing loans where you borrow money to purchase the house of your choice and repay the loan in monthly instalments.</p>\r\n<p>\r\n	You can get up to 80%-90% of the house&rsquo;s market price in the form of financing. The lender will hold the house until you completely repay the loan.</p>\r\n<p>\r\n	<strong>Home Construction Loan</strong></p>\r\n<p>\r\n	This is the right home loan type if you already have a plot of land and you need financing to construct a house in that land.</p>\r\n<p>\r\n	<strong>Home Extension Loan</strong></p>\r\n<p>\r\n	Say you already own a house and you would like to extend the house with another room or another floor to accommodate the growing family. Home extension loan provides financing for this purpose.</p>\r\n<p>\r\n	<strong>Home Improvement Loan</strong></p>\r\n<p>\r\n	A home improvement loan provides financing for renovating or repairing the house if there&rsquo;s any fault in the existing system, such as painting the house&rsquo;s interior or exterior, plumbing, upgrading the electrical system, waterproofing the ceiling, and more.</p>\r\n<p>\r\n	<strong>Home Loan Balance Transfer</strong></p>\r\n<p>\r\n	The current home loan interest rate may be overwhelming, or you may not be happy with your current lender&rsquo;s service; you can transfer the home loan&rsquo;s outstanding balance to a different lender who offers a lower interest rate and better service. Upon transfer, you can even check out the possibilities of a top-up loan on your existing one.</p>\r\n<p>\r\n	<strong>Composite Home Loan</strong></p>\r\n<p>\r\n	This type of home loan provides financing for purchasing the plot of land where you would like to construct a house and for the construction, both within a single loan.</p>\r\n<p>\r\n	<strong>Benefits of Taking a Home Loan</strong></p>\r\n<p>\r\n	<strong>Tax benefits</strong></p>\r\n<p>\r\n	The foremost benefit of a home loan is the income tax deduction you can claim on the interest and principal repayments. You can claim up to Rs.1.5 lakh on principal repayments u/s 80C, up to Rs.2 lakh on interest repayments u/s 24B, up to Rs.2 lakh on interest repayment in special circumstances u/s 80EE and 80EEA, and up to Rs.1.5 lakh on stamp duty expenses u/s 80C.</p>\r\n<p>\r\n	<strong>Lower interest rate</strong></p>\r\n<p>\r\n	The home loan interest rate is much lower as compared to any other loan types available. If you come across a cash crunch, you may get a top-up on the existing home loan at a lower interest rate than a personal loan to solve the issue.</p>\r\n<p>\r\n	<strong>Due diligence of property</strong></p>\r\n<p>\r\n	When you go through a bank to purchase a house, the bank will conduct thorough checks on the property from the legal perspective and check if all the documents produced are valid.</p>\r\n<p>\r\n	This due diligence check from the bank&rsquo;s end will reduce the risk of you being scammed. If the bank approves the property, that means you and your house are safe.</p>\r\n<p>\r\n	<strong>Long repayment tenure</strong></p>\r\n<p>\r\n	Unlike any other loans, home loans come with longer repayment tenure, as much as 25-30 years. This is owing to the significant loan amount one will have to borrow to purchase a house.</p>\r\n<p>\r\n	Spreading the loan amount and interest applicable over a longer tenure will reduce the monthly EMIs reducing the borrower&rsquo;s burden.</p>\r\n<p>\r\n	<strong>No prepayment penalty</strong></p>\r\n<p>\r\n	When you take a floating-rate home loan, you can make prepayments towards the loan whenever you have a lump sum at hand without having to pay any prepayment penalty. This will help you close the home loan much before the set loan tenure.</p>\r\n<p>\r\n	<strong>Balance transfer facility</strong></p>\r\n<p>\r\n	You can transfer the home loan from one lender to another for several reasons, such as the interest rate, service charges, customer service experience, and others.&nbsp;</p>\r\n', '', '', ''),
(39, '2', 'Home Insurance ', 'nyet.htm', '<p>\r\n	<strong>Home Insurance: Protect Your Home and Peace of Mind</strong></p>\r\n<p>\r\n	Home insurance, also known as property or homeowner insurance, offers comprehensive protection for both the structure and contents of your home. It safeguards against unexpected losses or damages caused by theft, natural calamities, fire accidents, and more. Whether you own a house, rent an apartment, or live in a luxury mansion, a home insurance policy ensures you&rsquo;re covered.</p>\r\n<p>\r\n	<strong>Key Benefits &amp; Features</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Comprehensive Coverage</strong>: Protects both the house structure and its contents.</li>\r\n	<li>\r\n		<strong>Quick Rebuilding</strong>: Facilitates fast rebuilding of damaged property.</li>\r\n	<li>\r\n		<strong>Customizable Coverage</strong>: Option to purchase fire accident coverage separately.</li>\r\n	<li>\r\n		<strong>Valuable Items Protection</strong>: Covers items like jewelry and paintings.</li>\r\n	<li>\r\n		<strong>Hassle-Free Claims:</strong> Quick and straightforward claim settlement process.</li>\r\n	<li>\r\n		<strong>Peace of Mind:</strong> Stay stress-free knowing your home is protected.</li>\r\n	<li>\r\n		<strong>Multiple Add-Ons</strong>: Additional coverage options like loss of rent, dog insurance, and more.</li>\r\n</ul>\r\n<p>\r\n	<strong>Types of Home Insurance Policies</strong></p>\r\n<ul>\r\n	<li>\r\n		Standard Fire and Special Perils PolicyCovers damage or loss due to natural calamities like earthquakes and volcanic eruptions, as well as man-made incidents like water tank overflow or pipe bursts.</li>\r\n	<li>\r\n		Public Liability Coverage</li>\r\n	<li>\r\n		Protects against loss or damage caused to guests or third parties within the insured property.</li>\r\n	<li>\r\n		Burglary and Theft Insurance</li>\r\n	<li>\r\n		Covers damage and loss of contents due to burglary or theft in the insured home.</li>\r\n	<li>\r\n		Personal Accident Coverage</li>\r\n	<li>\r\n		Provides compensation for permanent disabilities or death resulting from accidents or physical injuries, anywhere in the world.</li>\r\n	<li>\r\n		Contents Insurance</li>\r\n	<li>\r\n		Protects valuable contents within the home, including electronics, important documents, and more, against fire, theft, and other damages.</li>\r\n	<li>\r\n		Landlord Insurance</li>\r\n	<li>\r\n		Tailored for landlords to cover building maintenance and protect against loss of rent and public liability.</li>\r\n	<li>\r\n		Tenant Insurance</li>\r\n	<li>\r\n		Designed for tenants to cover personal belongings within a rented property.</li>\r\n	<li>\r\n		<strong>Why Choose Home Insurance?</strong></li>\r\n</ul>\r\n<p>\r\n	Comprehensive Protection: Ensures both your home&rsquo;s structure and contents are protected.<br />\r\n	Stress-Free Living: Provides peace of mind from unforeseen damages.<br />\r\n	Fast Recovery: Facilitates quick rebuilding and settlement processes.<br />\r\n	Flexible Options: Choose from various plans and add-ons to suit your specific needs.<br />\r\n	Valuable Items Cover: Protects high-value items like jewelry and artwork.</p>\r\n<p>\r\n	Secure your home and valuables with a home insurance policy, and live worry-free knowing you&rsquo;re prepared for any unexpected events.</p>\r\n', '', '', '');
INSERT INTO `subsubcategory` (`id`, `subcategory`, `subsubcategory`, `photo`, `detail`, `title`, `metatag`, `descp`) VALUES
(2, 1, 'Car Insurance', 'car blog picture.jpg', '<p>\r\n	In a country as diverse &amp; dynamic as India, having the right car insurance is not just essential&mdash;it&#39;s a necessity. Whether you&#39;re navigating the bustling streets of Mumbai, cruising through the serene landscapes of Kerala, or commuting in the vibrant cities of Delhi or Bangalore, your vehicle deserves the best protection. That&#39;s where we come in.</p>\r\n<p>\r\n	At Aadeeshwara Fintech Pvt. Ltd., we are committed to helping you find the perfect coverage that fits your unique needs and circumstances.</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>Why Choose Aadeeshwara?</strong></span></p>\r\n<p>\r\n	<strong>Local Expertise:</strong> We understand that the Indian car insurance landscape can be complex, with a variety of coverage options and regional nuances. Our team of local experts is well-versed in the Indian insurance market, ensuring that you receive advice, tailored to your specific location and requirements.</p>\r\n<p>\r\n	<strong>Diverse Coverage Options:</strong> Insurers offers a range of vehicle insurance plans, from third-party liability coverage to comprehensive policies. We work with a network of top insurance providers to offer you a diverse selection of options, so you can choose a plan that aligns with your budget and needs.</p>\r\n<p>\r\n	<strong>Affordability:</strong> We recognize that cost is a crucial factor when choosing insurance in India. Our experts will help you explore cost-effective options and discounts, ensuring you get the best value for your money without compromising on protection.</p>\r\n<p>\r\n	<strong>Ease of Claim:</strong> In the unfortunate event of an accident, our dedicated support team is here to guide you through the claims process, simplifying the often-complex procedures to get you back on the road quickly.</p>\r\n<p>\r\n	<strong>Customer-Centric Approach:</strong> At Aadeeshwara Fintech Pvt. Ltd., we put our customers at the heart of everything we do. We&#39;re committed to providing the highest level of service, ensuring that you have a smooth and hassle-free experience.</p>\r\n<p>\r\n	India&#39;s roads can be unpredictable, but your car insurance doesn&#39;t have to be. Protect your vehicle with a plan that&#39;s tailored to your unique needs. Reach out to us today for a free consultation and let us be your trusted partner in securing the right car insurance coverage. Call us for a quick quote!</p>\r\n', '', '', ''),
(9, 7, 'Pension Plan ', 'pension_plan _12 (1).png', '<p>\r\n	Pension plans are your ticket to a secure retirement. They let you save a portion of your income during your working years, investing it to grow over time. This creates a fund that ensures a steady income stream when you retire.</p>\r\n<p>\r\n	<strong>Benefits Of Pension Plans</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Financial Security:</strong> A pension plan guarantees a reliable income during retirement, easing financial worries.</li>\r\n	<li>\r\n		<strong>Wealth Accumulation:</strong> Contributions made over time build a substantial fund to support your post-retirement lifestyle.</li>\r\n</ul>\r\n<p>\r\n	<strong>Types Of Pension Plans Offered:</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Deferred Annuity:</strong> Money saved over time that grows until retirement, then provides regular payments for the rest of life.</li>\r\n	<li>\r\n		<strong>Immediate Annuity: </strong>Lump sum payment that instantly starts regular payments for life.</li>\r\n	<li>\r\n		<strong>National Pension Scheme (NPS):</strong> Retirement savings plan where contributions grow through investments, providing a pension upon retirement.</li>\r\n	<li>\r\n		<strong>Defined Benefit:</strong> Company sponsored pension giving a fixed amount based on salary, service years, and retirement age.</li>\r\n	<li>\r\n		<strong>Whole Life ULIPs: </strong>Life insurance with investment options providing coverage and investment growth.</li>\r\n	<li>\r\n		<strong>Annuity Certain:</strong> Payments made for a fixed period, regardless of life duration; if the recipient dies, payments continue to beneficiaries.</li>\r\n	<li>\r\n		<strong>Guaranteed Minimum Pension (GMP): </strong>Minimum assured pension by the employer for employees in a company pension scheme.</li>\r\n	<li>\r\n		<strong>Personal Pension Plans:</strong> Individual retirement savings plans separate from employer schemes, funded and managed personally.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Tailored Solutions: </strong>Our pension plans cater to diverse needs and preferences, offering a range of options to suit your goals.</li>\r\n	<li>\r\n		<strong>Expert Guidance:</strong> Backed by experienced financial experts, we assist you in choosing the best plan aligned with your retirement aspirations.</li>\r\n	<li>\r\n		<strong>Commitment to You:</strong> With us, it&rsquo;s not just about plans; it&#39;s about your peace of mind. We prioritize your financial security and happiness.</li>\r\n</ul>\r\n', '', '', ''),
(17, 9, 'Personal Accident ', 'Personal Accident _15.jpeg', '<p>\r\n	A personal accident insurance policy provides protection against death, permanent total or partial disability, and temporary disability in case of an accident. In case of death or permanent disability, the insurer pays a sum insured, and the policy terminates thereafter.</p>\r\n<p>\r\n	While in the case of partial disability, only a percentage of the sum insured is paid depending on the severity of disability, whereas a weekly compensation is provided in case of temporary total disability. The personal accident insurance policy is renewable if the accident results in permanent partial disability or temporary total disability.</p>\r\n<p>\r\n	The personal accident insurance policy can be seen as an income protection plan where your profession and income determine your maximum cover and premium rates. Generally, you can get a maximum cover that is 10 times your annual income, and the premium rates usually depend on your profession.</p>\r\n<p>\r\n	<strong>What is Covered Under Personal Accident Insurance ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>&nbsp;Accidental Death Cover</strong> : An emergency such as an accident can be both financially and emotionally distressing for the policyholder&rsquo;s family members. In case the policyholder suffers fatal injuries or dies due to the accident, the entire sum insured is paid to the nominee as mentioned in the policy document.</li>\r\n	<li>\r\n		<strong>Permanent Total Disability Cover:&nbsp;</strong>If the accident results in permanent disability or lifelong impairment such as loss of limbs, then a pre-determined sum insured is paid to the policyholder depending on the severity.</li>\r\n	<li>\r\n		<strong>Permanent Partial Disability Cover :</strong> Under the personal accident insurance policy, a certain percentage (up to 100%) of the sum insured is paid to the insured in case of bodily injuries resulting in permanent partial disability.</li>\r\n	<li>\r\n		<strong>Temporary Total Disability Cover:&nbsp;</strong>If the policyholder meets temporary total disability and gets bedridden, the insurer provides a weekly allowance as compensation for the loss of income.</li>\r\n</ul>\r\n<p>\r\n	<strong>Types of Personal Accident Insurance</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Cover for Medical Expenses:</strong> If you get hurt accidentally, this insurance helps pay for hospital bills, surgeries, and recovery costs, easing the financial strain.</li>\r\n	<li>\r\n		<strong>Replacement for Lost Income:</strong> If you can&#39;t work due to an accident, the insurance offers money to help you manage financially while you recover.</li>\r\n	<li>\r\n		<strong>Support in Case of Accidental Death:</strong> If the worst happens and you pass away due to an accident, the insurance gives a lump sum to your chosen person, supporting them financially.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Comprehensive Coverage:</strong> We might offer extensive coverage for personal accidents, encompassing a wide range of scenarios including disabilities, injuries, and fatalities arising from accidents.</li>\r\n	<li>\r\n		<strong>Customizable Plans: </strong>They might offer flexible plans tailored to meet individual needs. This allows customers to choose coverage levels, add-ons, and options that suit their lifestyle and requirements.</li>\r\n	<li>\r\n		<strong>Prompt Claim Settlement:</strong> We might have a reputation for efficient and prompt claim settlements. This can be crucial during distressing times, ensuring quick support when needed.</li>\r\n	<li>\r\n		<strong>Value-Added Services: </strong>Beyond insurance coverage, they might offer additional services such as 24/7 helplines, medical assistance, or support networks that add value to their policies.</li>\r\n	<li>\r\n		<strong>Reputation and Trust:</strong>&nbsp; We has a strong track record, positive reviews, and a reputation for reliability, this could make&nbsp; a trustworthy choice for personal accident coverage.</li>\r\n</ul>\r\n', '', '', ''),
(18, 7, 'Unit Linked insurance plan ', 'Unit linked insurance plan _15.PNG', '<p>\r\n	The acronym ULIP stands for Unit Linked Insurance Plan. It is a comprehensive insurance package that serves a dual purpose: providing an avenue for investment to fulfill long-term objectives and ensuring a life cover for your family&#39;s financial security in unforeseen circumstances. The premium paid for a ULIP is divided into two segments: a portion allocated to the life cover and the remaining portion directed towards investment in a chosen fund. These funds can be equity-based, debt-based, or a mix of both, tailored to match your risk tolerance and financial goals. ULIPs present an advantageous investment opportunity to address both your and your family&#39;s future aspirations effectively.</p>\r\n<p>\r\n	ULIPs = Insurance + Investment: ULIPs are like a superhero plan. They give you both insurance coverage to protect your family and a chance to invest your money in different ways. You get to choose where your money goes &ndash; like into stocks, bonds, or both!.</p>\r\n<p>\r\n	<strong>Why Are ULIP&rsquo;s So Important ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Keeping Your Family Safe:</strong> If something unexpected happens to you, ULIPs make sure your family is taken care of financially.</li>\r\n	<li>\r\n		<strong>You&#39;re the Boss:</strong> With ULIPs, you&#39;re in control. You can change how your money is invested based on what&#39;s happening in the world or what you want for the future.</li>\r\n	<li>\r\n		<strong>Growing Your Money:</strong> ULIPs aren&#39;t just about protecting money; they&#39;re also about making it grow. It&#39;s like planting seeds for your future wealth!.</li>\r\n</ul>\r\n<p>\r\n	<strong>Types of Unit linked Insurance Plan&nbsp;</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Single-Premium ULIPs:</strong> Policyholders pay the total premium amount in a single lump-sum payment.</li>\r\n	<li>\r\n		<strong>Regular Premium ULIPs:</strong> Premium payments are spread over time, and the frequency (monthly, bi-annual, or annual) is agreed upon between the policyholder and the insurer.</li>\r\n	<li>\r\n		<strong>Equity-Fund Based ULIPs:</strong> These ULIPs utilize equity funds as investment options, offering potentially high returns but also carrying high-risk factors.</li>\r\n	<li>\r\n		<strong>Debt-Fund Based ULIPs:</strong> These ULIPs primarily invest in low-risk instruments like government securities or corporate bonds, making them suitable for individuals with a low-risk tolerance and a priority for fund security over higher returns.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aaddeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Always There for You:</strong> Our team is here round-the-clock.</li>\r\n	<li>\r\n		<strong>Plans Made for You:</strong>We make plans that fit you perfectly. No one-size-fits-all here. Your dreams and goals matter, and our plans reflect that.</li>\r\n	<li>\r\n		<strong>Trust and Transparency:</strong>We believe in being open and honest. You&#39;ll always know what&#39;s happening with your money, no secrets!.</li>\r\n</ul>\r\n', '', '', ''),
(26, 9, 'Motor Insurance', 'Motor insurance _15.PNG', '<p>\r\n	Motor Insurance is to cover your vehicle from any accidents or natural disasters. The motor insurance includes&nbsp; two wheelers, four wheelers or any kind of vehicle permissible on road.</p>\r\n<p>\r\n	Along with own vehicle damage the motor insurance also provides the mandatory coverage for third-party liabilities. In simple words, comprehensive insurance gives you freedom to drive your car without any worry.&nbsp;</p>\r\n<p>\r\n	<strong>Types of Motor Insurance:</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Comprehensive motor insurance:</strong> Comprehensive vehicle insurance offers protection from legal liabilities and covers damages or losses during accidents. It safeguards your vehicle from various risks like road accidents, fire, theft, earthquakes, storms, floods, and more ensuring security amidst unforeseen events and providing peace of mind.</li>\r\n	<li>\r\n		<strong>Standalone OD cover:</strong> Introduced by IRDAI, the standalone Own Damage (OD) cover is a specialized insurance policy shielding vehicles from damages due to natural or man-made disasters. Whether you have third-party coverage elsewhere or with the same insurer, this policy stands as an additional safeguard for your vehicle, offering comprehensive protection and peace of mind against unexpected adversities and unforeseen incidents on the road</li>\r\n	<li>\r\n		<strong>Third-party motor insurance:</strong> In India, third-party motor insurance is a legal necessity. It shields policyholders from legal obligations resulting from accidents involving their vehicle. This means if your insured vehicle causes injury, death, or property damage to a third party, the insurer manages the legal responsibilities, ensuring financial coverage and compliance with the law.</li>\r\n</ul>\r\n<p>\r\n	<strong>Benefits of Motor Insurance:</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Damage of vehicle:</strong> If your vehicle gets damaged due to accidents, fire, or self-ignition, your insurance protects you. It also covers losses from theft, burglary, strikes, riots, or terrorism. Car insurance even safeguards against damage while in transit by rail, waterways, air, road, or lift&nbsp; a comprehensive shield for various situations ensuring peace of mind.</li>\r\n	<li>\r\n		<strong>Personal Accident:</strong> Car insurance includes personal accident cover for a set amount. It protects against permanent total disability and accident-related death. Also, passengers (up to the vehicle&#39;s seating capacity) can get this cover for a predetermined amount. It&#39;s an added safety net for unforeseen incidents, ensuring financial security.</li>\r\n	<li>\r\n		<strong>Third party liabilities: </strong>Your car insurance provides coverage if your vehicle causes damage or loss to someone else&#39;s property in an accident. It also safeguards you from legal responsibilities arising from bodily injury or death of a third party. In such unfortunate events, the insurance steps in to offer financial protection, managing the aftermath and ensuring you&#39;re covered against potential liabilities, thereby offering peace of mind.</li>\r\n	<li>\r\n		<strong>No claim Bonus: </strong>Your car insurance acts as a shield in case your vehicle causes damage to someone else&#39;s property during an accident. It also safeguards you from legal responsibilities if there&#39;s bodily injury or unfortunate death of a third party involved. In such unforeseen events, the insurance steps in, offering not just financial protection but also handling the aftermath and potential liabilities. This comprehensive coverage ensures your peace of mind, providing a safety net in challenging times.</li>\r\n</ul>\r\n<p>\r\n	<strong>Why Choose Aadeeshwara ?</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>Multiple Options:</strong> Abundance of Choices we&nbsp; offers diverse insurance options, suggesting based on companies&#39; performances for easy decision-making aligned with your needs.</li>\r\n	<li>\r\n		<strong>Quick Process:</strong> Time-Friendly Services we prioritizes your time by providing flexible and convenient services tailored to your schedule and comfort.</li>\r\n	<li>\r\n		<strong>Support Throughout:</strong> Simplified Claims we simplifies the insurance claim process, offering guidance and support, ensuring clarity and ease throughout each step for you.</li>\r\n</ul>\r\n', '', '', '');
