(5, 'RKSharma.jpg', 'R K Sharma, Faridabad', 'Insurance Partner', 5, '<p>\r\n	I&#39;ve known Mr. Amit Jain for 7 years, receiving consistent support in various business aspects. His unwavering assistance during customer distress and claim service complications is truly commendable. Best wishes to him on his new venture, Aadeeshwara Fintech Pvt. Ltd.</p>'),
(6, 'adeetest.jpg', 'Suman Saxena, Aligarh ', 'Financial Consultant', 5, '<p>\r\n	Over six years, my lasting association with Aadeeshwara Fintech Pvt. Ltd. remains strong. Their unwavering commitment promises immense benefits for partners, and with new plans in motion, it marks the start of a highly rewarding journey bound to flourish.</p>\r\n'),
(7, 'adeetest1.jpg', 'Nisha Chandak, NUMEX Collections', '.', 5, '<p>\r\n	Delighted with my recent partnership with Aadeeshwara Fintech, their support has propelled me toward securing my family&#39;s future and financial goals. Confident that this collaboration will empower more women like me to take control of their financial futures.</p>\r\n'),
(8, 'maheshji.jpg', 'Mahesh Kumar Harsana, Gurgaon', 'Customer', 5, '<p>\r\n	My association with this team, who have now formed a company called Aadeeshwara, dates back to the year 2020. I took a car insurance policy and am extremely satisfied with their services. Their commitment to excellence and customer satisfaction assures me of a long-lasting and positive partnership. I look forward to more ventures with the Aadeeshwara team.</p>\r\n'),
(9, 'ram tirath.jpg', 'Ram Tirath Singh', 'Business Partner, Begusarai, Bihar', 5, '<p>\r\n	I&#39;ve been connected with the team of AFPL for more than 1 year, and I&#39;m sure their recent initiatives will make our journey together highly worthwhile. The team&#39;s dedication and innovative approach continue to inspire confidence, ensuring a positive and prosperous future in our collaboration.</p>\r\n');
